--
-- Estrutura para view `VW_ANALISES`
--
DROP TABLE IF EXISTS `VW_ANALISES`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `VW_ANALISES`  AS SELECT `AXL`.`Id_Analise` AS `Id_Analise`, `AXL`.`Nome` AS `Nome` FROM (select `LAU`.`IDLaudo` AS `Id_Analise`,`LAU`.`Descricao` AS `Nome` from `laudo` `LAU` where (`LAU`.`IDLaudo` in (2,3,6)) union all select '4' AS `Id_Analise`,'Resistência à Antimicrobianos' AS `Nome`) AS `AXL` ORDER BY `AXL`.`Id_Analise` ASC ;

-- --------------------------------------------------------

--
-- Estrutura para view `VW_ANALISE_PISCICULTURA`
--
DROP TABLE IF EXISTS `VW_ANALISE_PISCICULTURA`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `VW_ANALISE_PISCICULTURA`  AS SELECT `AXL`.`IDPsicultura` AS `Id_Piscicultura`, `AXL`.`IDLaudo` AS `Id_Analise`, max(`LAD`.`Descricao`) AS `Nome`, count(`AXL`.`IDLaudo`) AS `Quantida_Analise` FROM (`aux_laudos` `AXL` join `laudo` `LAD` on((`AXL`.`IDLaudo` = `LAD`.`IDLaudo`))) GROUP BY `AXL`.`IDPsicultura`, `AXL`.`IDLaudo` ;

-- --------------------------------------------------------

--
-- Estrutura para view `VW_GESTAO_AGUA`
--
DROP TABLE IF EXISTS `VW_GESTAO_AGUA`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `VW_GESTAO_AGUA`  AS SELECT `p`.`IDPsicultura` AS `Id_Piscicultura`, `a`.`amonia` AS `Amonia`, `a`.`nitrito` AS `Nitrito`, `a`.`nitrato` AS `Nitrato`, `a`.`fosforo` AS `Fosforo`, `a`.`turbidez` AS `Turbidez`, `a`.`alcalinidade` AS `Alcalinidade`, `a`.`Ponto` AS `Ponto`, `a`.`DataColeta` AS `Data` FROM ((((`agua` `a` join `psicultura` `p` on((`p`.`IDPsicultura` = `a`.`IDPsicultura`))) join `cidade` `c` on((`c`.`ID` = `p`.`Cidade_ID`))) join `aux_laudos` `al` on((convert(`al`.`ID_amostras` using utf8) = `a`.`IDAmostra`))) join `estado` `e` on((`e`.`ID` = `c`.`ID_Estado`))) ;

-- --------------------------------------------------------

--
-- Estrutura para view `VW_GESTAO_MICROBIOLOGICO`
--
DROP TABLE IF EXISTS `VW_GESTAO_MICROBIOLOGICO`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `VW_GESTAO_MICROBIOLOGICO`  AS SELECT `m`.`data_campo` AS `Data`, `m`.`IDPsicultura` AS `Id_Piscicultura`, `m`.`peso` AS `Peso`, (case when (`a`.`ID_Molecular` = '') then 'Em andamento' else `a`.`ID_Molecular` end) AS `Bacteria`, count(`a`.`ID_Molecular`) AS `Quantidade` FROM ((`aux_anti` `a` join `material_fraguimentos` `mf` on((convert(`mf`.`IDPeixe` using utf8) = `a`.`Amostra`))) join `material` `m` on((`m`.`IDMaterial` = `mf`.`IDMaterial`))) GROUP BY `m`.`peso`, `m`.`data_campo`, `m`.`IDPsicultura`, `a`.`ID_Molecular` ;

-- --------------------------------------------------------

--
-- Estrutura para view `VW_GESTAO_MOLECULAR_VIRAL`
--
DROP TABLE IF EXISTS `VW_GESTAO_MOLECULAR_VIRAL`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `VW_GESTAO_MOLECULAR_VIRAL`  AS SELECT `MV`.`data_coleta` AS `Data`, `MV`.`IDPsicultura` AS `Id_Piscicultura`, `LV`.`peso_lote` AS `Peso`, `LV`.`Resultado` AS `Resultado`, `LV`.`NF` AS `Tipo` FROM (`laudo_viral` `LV` join `molecular_viral` `MV` on((`LV`.`Viral_ID` = `MV`.`IDViral`))) ORDER BY `MV`.`data_coleta` DESC ;

-- --------------------------------------------------------

--
-- Estrutura para view `VW_GESTAO_RESISTENCIA_ANTIMICROBIANOS`
--
DROP TABLE IF EXISTS `VW_GESTAO_RESISTENCIA_ANTIMICROBIANOS`;

CREATE ALGORITHM=UNDEFINED DEFINER=`prevet55`@`localhost` SQL SECURITY DEFINER VIEW `VW_GESTAO_RESISTENCIA_ANTIMICROBIANOS`  AS SELECT `a`.`ID_Molecular` AS `Bacteria`, `p`.`IDPsicultura` AS `Id_Piscicultura`, `a`.`IDAntibioticos` AS `Id_Antibiotico`, `a`.`Resultados` AS `Resultado`, `m`.`peso` AS `Peso`, (case when (`a`.`Resultados` < 30) then 1 else 0 end) AS `Quantidade_Resistente`, (case when (`a`.`Resultados` <> NULL) then 1 else 1 end) AS `Total`, `m`.`data_campo` AS `Data` FROM (((`antibiograma` `a` join `material_fraguimentos` `mf` on((`mf`.`IDPeixe` = `a`.`Amostra`))) join `material` `m` on((`m`.`IDMaterial` = `mf`.`IDMaterial`))) join `psicultura` `p` on((`p`.`IDPsicultura` = `m`.`IDPsicultura`))) ORDER BY `a`.`IDAntibioticos` ASC ;

-- --------------------------------------------------------

--
-- Estrutura para view `VW_PISCICULTURA_USUARIO`
--
DROP TABLE IF EXISTS `VW_PISCICULTURA_USUARIO`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `VW_PISCICULTURA_USUARIO`  AS SELECT `PSI`.`Id_Usuario` AS `Id_Usuario`, `PSI`.`Id_Monitoramento` AS `Id_Monitoramento`, `PSI`.`Status_Monitoramento` AS `Status_Monitoramento`, `PSI`.`Id_Pisicultura` AS `Id_Piscicultura`, `PSI`.`Nome` AS `Nome` FROM (select `PSU`.`IDUsuario` AS `Id_Usuario`,`PSI`.`IDJose` AS `Id_Monitoramento`,upper(`PSI`.`Aceito`) AS `Status_Monitoramento`,`PSU`.`IDPsicultura` AS `Id_Pisicultura`,upper(`PSI`.`Nome`) AS `Nome` from (`pis_usuario` `PSU` join `psicultura` `PSI` on((`PSU`.`IDPsicultura` = `PSI`.`IDPsicultura`))) union select `psicultura`.`IDUsuario` AS `Id_Usuario`,`psicultura`.`IDJose` AS `Id_Monitoramento`,upper(`psicultura`.`Aceito`) AS `Status_Monitoramento`,`psicultura`.`IDPsicultura` AS `Id_Pisicultura`,upper(`psicultura`.`Nome`) AS `Nome` from `psicultura`) AS `PSI` ;

-- --------------------------------------------------------

--
-- Estrutura para view `VW_USUARIO`
--
DROP TABLE IF EXISTS `VW_USUARIO`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `VW_USUARIO`  AS SELECT `usuario`.`IDUsuario` AS `Id_Usuario`, `usuario`.`Tipo_usuario_ID` AS `Id_Tipo_Usuario`, (case when (`usuario`.`Tipo_usuario_ID` = 5) then 'Admin' when (`usuario`.`Tipo_usuario_ID` = 6) then 'User' when (`usuario`.`Tipo_usuario_ID` = 7) then 'Histo' end) AS `Tipo_Usuario`, `usuario`.`Nome` AS `Nome`, `usuario`.`Apelido` AS `Apelido`, `usuario`.`email` AS `Email_Primario`, `usuario`.`email2` AS `Email_Secundario`, `usuario`.`senha` AS `Senha` FROM `usuario` ;

