(44, 'Baço', 'Comentario 1', 21),
(45, 'Estômago', 'Comentario 3', 21),
(46, 'Baço', 'Primeiro nossos corações se uniram e, começando a bater em conjunto, se tornaram em um só. Depois nossas mãos se apertaram uma na outra e não mais se separaram, e de duas vidas fizemos uma.', 30),
(47, 'Branquias', 'Saber que caminhamos lado a lado, na mesma direção, com o meu objetivo, é sentir em plenitude o doce sabor da felicidade, é olhar o futuro, o nosso futuro, com esperança no olhar, alegria no coração e um grande sorriso nos lábios.', 30),
(48, 'Baço', 'Baço se parece muito com Braço não é ?', 354),
(49, 'Intestino', 'Intestino é meio nojento mas tudo bem, não tem problema ', 354),
(50, 'Branquias', 'Branquias são algumas coisas que os peixes tem', 354),
(51, 'Baço', '2º - os textos não são simples amontoados de palavras ou frases, ou seja, eles precisam fazer sentido. ', 100),
(52, 'Baço', '1º - os textos não são apenas escritos, eles também podem ser orais; ', 100),
(53, 'Estômago', 'Você já se perguntou o que é, de fato, um texto? Geralmente, entendemos o texto como um conjunto de frases, ou seja, algo que foi feito para ser lido. Mas a definição de texto não é tão simples quanto parece.\n\nImagine, por exemplo, que você está lendo um livro e, de repente, encontra em uma página qualquer um papel com a palavra “madeira”. Ora, certamente você ficará intrigado ou simplesmente não dará importância a isso. ', 100),
(54, 'Estômago', '\nEducação\nportuguês\nEstudo do texto\nO que é um texto?\nO que é um texto?\n\nPor Elaine Brito Souza\n\nMestre em Literatura Brasileira pela UERJ; Doutoranda em Literatura Brasileira pela UFRJ\n\nRevendo conceitos\n\nVocê já se perguntou o que é, de fato, um texto? Geralmente, entendemos o texto como um conjunto de frases, ou seja, algo que foi feito para ser lido. Mas a definição de texto não é tão simples quanto parece.\n\nImagine, por exemplo, que você está lendo um livro e, de repente, encontra em uma página qualquer um papel com a palavra “madeira”. Ora, certamente você ficará intrigado ou simplesmente não dará importância a isso.\n\nAgora, vamos imaginar outra situação: você está no meio de uma floresta e ouve alguém gritar: “Madeira!”. Bem, se você pretende preservar sua vida, sua reação imediata é sair correndo. Isso acontece porque a situação em que você se encontra levou-o a interpretar o grito como um sinal de alerta. ', 100),
(58, 'Baço', 'O contexto pode ser explícito, quando é expresso por palavras (o texto em que se encontra a frase ou a frase em que se encontra a palavra), ou implícito, quando está embutido na situação em que o texto é produzido. Logo, a simples mudança de contexto faz com que a palavra “madeira” seja interpretada de maneiras diferentes. Na primeira situação, embora a palavra esteja dentro de um livro, ela está totalmente fora de contexto, por isso não produz sentido algum', 1325),
(59, 'Estômago', 'Em linguística, a noção de texto é ampla e ainda aberta a uma definição mais precisa. Grosso modo, pode ser entendido como manifestação linguística das ideias de um autor, que serão interpretadas pelo leitor de acordo com seus conhecimentos linguísticos e culturais. Seu tamanho é variável. ', 1325),
(60, 'Branquias', 'Todo texto tem que ter alguns aspectos formais, ou seja, tem que ter estrutura, elementos que estabelecem relação entre si. Dentro dos aspectos formais temos a coesão e a coerência, que dão sentido e forma ao texto. \"A coesão textual é a relação, a ligação, a conexão entre as palavras, expressões ou frases do texto”.[4] A coerência está relacionada com a compreensão, a interpretação do que se diz ou escreve. Um texto precisa ter sentido, isto é, precisa ter coerência. Embora a coesão não seja condição suficiente para que enunciados se constituam em textos, são os elementos coesivos que lhes dão maior legibilidade e evidenciam as relações entre seus diversos componentes, a coerência depende da coesão. ', 1325),
(61, 'Intestino', '', 11820),
(62, 'Baço', 'Tecido não exibe alterações, com arquitetura e celularidade preservadas. ', 11820),
(63, 'Branquias', 'A branquite parasitária se comprova pela presença de trematódeos aderidos as \nlamelas, compatível com Monogenea. Além disso, o edema intersticial e subepitelial \nexibem como principal causa a exposição a poluentes no ambiente.', 11820),
(64, 'Hepatopâncreas', '', 11820),
(65, 'Branquias', '', 11820),
(66, 'Hepatopâncreas', 'A degeneração celular macrogoticular é caracterizada pelo aumento da \nporcentagem de gordura na dieta ou diminuição de vitaminas específicas, como as \nantioxidantes.', 11820),
(67, 'Intestino', 'Os impactos da enterite fúngica por protozoários são principalmente a redução \nda função digestiva e da absorção intestinal, como resultado da atividade reprodutiva do \nagente que causa a perda gradual da função das células epiteliais intestinais.\n', 11820),
(78, 'Intestino', 'A hiperplasia de enterócitos indica processo inicial de resposta contra um agente agressor em potencial.', 182),
(79, 'Estômago', 'O órgão não exibe alteração de arquitetura e celularidade.', 182),
(80, 'Hepatopâncreas', 'O órgão não exibe alteração de arquitetura e celularidade.', 182),
(81, 'Brânquias', 'A branquite proliferativa é interpretada como uma reação inicial das brânquias ao estresse químico ou a agentes biológicos e as alterações de hiperplasia e fusão lamelar caracterizam uma tentativa inespecífica do organismo em diminuir o contato com o agente agressor. O edema intersticial e subepitelial exibem como principal causa a exposição a poluentes no ambiente, à exemplo de metais pesados. A branquite parasitária se comprova pela presença de trematódeos aderidos às lamelas e a telangiectasia é uma alteração vascular comum em brânquias e refere injúria aguda ao órgão.', 182),
(82, 'Estômago', 'O tecido não exibe alterações de arquitetura e celularidade.', 210),
(83, 'Hepatopâncreas', 'O tecido não exibe alterações de arquitetura e celularidade.', 210),
(84, 'Intestino', 'A necrose das vilosidades pode indicar a ingestão de toxinas ou a presença de um agente infeccioso em potencial.', 210),
(85, 'Brânquias', '    A branquite proliferativa é interpretada como uma reação inicial das brânquias ao estresse químico ou a agentes biológicos e as alterações de hiperplasia e fusão lamelar caracterizam uma tentativa inespecífica do organismo em diminuir o contato com o agente agressor em potencial.  ', 210),
(86, 'Rim', 'O material proteináceo no lúmen tubular (100%) indica lise celular.', 856),
(87, 'Brânquias', 'A hiperplasia de células epiteliais (50%) indica a persistência de uma agente\nbiológico, físico ou químico, porém a visualização de cocos bacterianos (50%) sugere que\nse trata de uma infecção biológica. As demais amostras podem conter o mesmo patógeno\nou de outra origem.', 856),
(88, 'Músculo esquelético', 'Sem alteração patológica digna de nota (100%).', 856),
(89, 'Intestino', 'Sem alteração patológica digna de nota (100%).', 856),
(90, 'Cerebro', 'A inflamação (100%) pode estar sendo causada por agentes biológicos, uma vez\nque os linfócitos são encontrados nesse tipo de infecção.', 856),
(91, 'Hepatopâncreas', 'A degeneração macrogoticular de hepatócitos (100%) pode ser em\ndecorrência de excesso de gordura na dieta ou intoxicação química. O material proteináceo\n(100%) indica lise celular que pode estar sendo causada por bactérias, uma vez que foram\nvistos cocos bacterianos (100%) em todas as amostras', 856),
(98, 'Intestino', 'A lise das vilosidades intestinais (100%), necrose de coagulação das vilosidades\nintestinais (100%) e eosinófilos (100%) sugerem a persistência de um agente biológico,\nquímico ou físico', 886),
(99, 'Estômago', 'A presença de eosinófilos (100%), congestão (100%) e necrose de coagulação\n(50%) indica infecção biológica (parasitária ou fúngica) ou quadro de alergia', 886),
(100, 'Brânquias', 'A hiperplasia de células epiteliais e de Goblet (100%), metaplasia (100%) e\nfusionamento lamelar (100%) indicam persistência de agente biológico, uma vez que\nforam notados cistos de epiteliocystis (50%). A outra amostra pode conter o mesmo\npatógeno ou de outra origem', 886),
(101, 'Fígado', 'A congestão (100%) pode ser devido a presença de agente químico ou biológico.\nA degeneração macrogoticular de hepatócitos (100%) sugere excesso de gordura na dieta\nou intoxicação química', 886),
(102, 'Coração', ' A hemorragia (33,33%) e linfócitos (100%) sugere a persistência de agente\nbiológico, uma vez que os linfócitos são encontrados em infecções biológicas. Essa\nhipótese é reafirmada pela visualização de cocos bacterianos (66,66%). A outra amostra\npode conter bactérias ou um agente de outra origem', 891),
(103, 'Fígado', 'A congestão (100%), a presença de linfócitos (100%) e deposição de melanina\n(66,66%) pode estar sendo causada por agentes biológicos, uma vez que os linfócitos são\ncomuns nesse tipo de infecção. Esse achado é reafirmado pela visualização de cocos\nbacterianos (100%). A degeneração macrogoticular de hepatócitos (100%) sugere excesso\nde gordura na dieta ou intoxicação química', 891),
(108, 'Estômago', ': A necrose de coagulação (50%), lise do epitélio (50%) e eosinófilos (50%)\nsugere que a lesão pode ser de origem biológica, uma vez que os eosinófilos são células\nfrequentes nesse tipo de infecção. Outra hipótese é quadro de alergia.', 890),
(109, 'Fígado', 'A congestão (50%) e a presença de linfócitos (50%) pode estar sendo causada por\nagentes biológicos, uma vez que os linfócitos são comuns nesse tipo de infecção. Esse\nachado é reafirmado pela visualização de cocos bacterianos (50%). A outra amostra pode\nconter o mesmo patógeno ou de outra origem. A degeneração macrogoticular e\nmicrogoticular de hepatócitos (100%) sugere excesso de gordura na dieta ou intoxicação\nquímica.', 890),
(110, 'Brânquias', 'A hiperplasia de células epiteliais (33,33%), fusionamento lamelar (100%) e\naneurisma (100%) sugere a persistência de agente biológico, químico ou físico.', 890),
(111, 'Intestino', 'A lise das vilosidades intestinais (100%), necrose de coagulação das vilosidades\nintestinais (100%) e eosinófilos (100%) ugere que a lesão pode ser de origem biológica,\numa vez que os eosinófilos são células frequentes nesse tipo de infecção. Também pode\nestar sendo causada por um quadro alérgico', 890),
(112, 'Fígado', 'A congestão (100%) e presença de linfócitos (100%) pode ser devido a presença\nde agente biológico, uma vez que os linfócitos são encontrados nesse tipo de infecção. Esse\nachado é reafirmado pela visualização de colônias bacterianas (50%). A outra amostra pode\nconter o mesmo patógeno ou de outra origem. A degeneração macrogoticular de\nhepatócitos (100%) sugere excesso de gordura na dieta ou intoxicação química', 887),
(113, 'Baço', 'A hemorragia (100%) e a presença de centros-melanomacrófagos (50%) sugere a\npersistência de agente biológico, uma vez que os macrófagos são encontrados em infecções\nbiológicas. Essa hipótese é confirmada pela visualização de colônias bacterianas (50%). A\noutra amostra pode conter o mesmo patógeno ou de outra origem.\n', 887),
(114, 'Intestino', 'A lise das vilosidades intestinais (100%), hiperplasia de enterócitos (100%),\nnecrose de coagulação das vilosidades intestinais (50%) e eosinófilos (100%) sugerem a\npersistência de um agente biológico, uma vez que foram notadas colônias bacterianas\n(100%).', 887),
(115, 'Brânquias', 'A hiperplasia de células epiteliais (100%) e fusionamento lamelar (50%)\nindicam persistência de agente biológico, uma vez que foram notados cistos de\nepiteliocystis (50%). A outra amostra pode conter o mesmo patógeno ou de outra origem', 887),
(116, 'Estômago', 'A presença de eosinófilos (100%) indica infecção biológica (parasitária ou\nfúngica) ou quadro de alergia.', 887),
(117, 'Intestino', 'A atrofia das vilosidades intestinais e hiperplasia de enterócitos podem ser causadas por agentes químicos, físicos ou biológicos.', 999),
(118, 'Brânquias', 'A hiperplasia de células epiteliais, aneurisma, lise do epitélio branquial, necrose de coagulação do epitélio branquial podem ser causados por agentes biológicos, químicos ou físicos. No entanto, a visualização de Trichodina e cisto contendo estruturas sugestivas de mixosporídeos sugere que as lesões foram causadas por parasitas.', 999),
(119, 'Rim', 'A hemorragia, inflamação por linfócitos, degeneração hialina tubular e necrose tubular pode ser causada por agentes biológicos, uma vez que os linfócitos são encontrados nesse tipo de infecção. No entanto, a visualização de cocos bacterianos sugere que as lesões foram causadas por bactérias.', 999),
(120, 'Baço', 'A hiperplasia de polpa branca, pigmento de hialina e centros melanomacrófagos podem ser causadas por agentes biológicos, uma vez que os linfócitos e macrófagos são encontrados nesse tipo de infecção. Essa hipótese é reafirmada pela visualização de cocos bacterianos.', 999),
(121, 'Fígado', 'A inflamação por linfócitos e congestão podem ser causadas por agentes biológicos, uma vez que os linfócitos são encontrados nesse tipo de infecção. A degeneração macrogoticular pode ser causada por intoxicação química ou excesso de gordura na dieta.', 999),
(122, 'Fígado', 'A congestão e hemossiderina demonstram que há lesão vascular que pode ser causada por agentes químicos, físicos ou biológicos. A degeneração macrogoticular de hepatócitos sugere excesso de gordura na dieta ou intoxicação química.', 1004),
(123, 'Baço', 'A hemorragia, centros-melanomarófagos, hiperplasia de polpa branca e pigmento de hialina indicam lise vascular que podem estar sendo causada por agentes biológicos, uma vez que os macrófagos e linfócitos são encontrados nesse tipo de infecção. Essa hipótese é reafirmada pela visualização de cocos bacterianos.', 1004),
(124, 'Intestino', 'A lise das vilosidades intestinais podem ser causadas por agentes químicos, físicos ou biológicos. No entanto, a visualização de estruturas sugestivas de coccídeos e cocos bacterianos, sugerem que a lesão pode ter sido causada por bactérias e parasitas.', 1004),
(125, 'Estômago', 'A presença de eosinófilos sugere uma infecção biológica, uma vez que foram notados cocos bacterianos.', 1004),
(126, 'Brânquias', 'A hiperplasia de células epiteliais e aneurisma podem ser causadas por agentes químicos, físicos ou biológicos. No entanto, a visualização de estruturas sugestivas de protozoários indicam que as lesões foram causadas por parasitas.', 1004),
(132, 'Fígado', 'A melanina e congestão pode ser causada por agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos sugere que as lesões possam estar sendo causadas por bactérias. A degeneração macrogoticular de hepatócitos sugere intoxicação química ou excesso de gordura na dieta.', 1000),
(133, 'Brânquias', 'A hiperplasia de células epiteliais, metaplasia e fusionamento lamelar podem ser causadas por agentes químicos, físicos ou biológicos. No entanto, a visualização de Trichodina em grande quantidade sugere que as lesões podem estar sendo causadas por parasitas.', 1000),
(134, 'Estômago', 'A inflamação por linfócitos e eosinófilos sugere uma infecção biológica, uma vez que essas células são encontradas nesse tipo de infecção.', 1000),
(135, 'Baço', 'A hemorragia e a presença de melanomacrófagos sugerem infecção biológica, uma vez que os macrófagos são encontrados nesse tipo de infecção.', 1000),
(136, 'Intestino', 'A lise das vilosidades intestinais e necrose de coagulação das vilosidades intestinais pode ser causada por agentes químicos, físicos ou biológicos.', 1000),
(137, 'Brânquias', 'A hiperplasia de células epiteliais e metaplasia pode ser causada por agentes químicos, físicos ou biológicos. No entanto, a visualização de Trichodina e Monogeneas sugere que as lesões estão sendo causadas por parasitas.', 1018),
(138, 'Intestino', 'A lise das vilosidades intestinais, necrose de coagulação das vilosidades intestinais, hiperplasia de enterócitos e eosinófilos sugere a presença de agene biológico, uma vez que os eosinófilos são encontrados em infecções parasitária, fúngicas e bacterianas.', 1018),
(139, 'Baço', 'A hiperplasia de polpa branca indica um aumento significativo de linfócitos que acontece sempre em resposta a uma infecção biológica.', 1018),
(140, 'Fígado', 'A congestão pode ser causada por agentes químicos, físicos ou biológicos. A degeneração macrogoticular de hepatócitos pode ser causada por excesso de gordura na dieta ou intoxicação química.', 1018),
(141, 'Brânquias', 'A necrose de coagulação e lise de epitélio branquial pode ser causada por agentes químicos, físicos ou biológicos. No entanto, a visualização de estruturas sugestivas de fungos, Trichodina, Monogenea e granulomas sugerem que as lesões foram causadas por fungos e parasitas.', 1050),
(142, 'Bexiga natatória', 'Embora não tenha sido observada lesão, foram notados cocos bacterianos.', 1050),
(143, 'Estômago', 'A necrose de coagulação pode ser causada por agentes químicos, físicos ou biológicos.', 1050),
(144, 'Baço', 'A hiperplasia de polpa branca e centros-melanomacrófagos sugere um infecção biológica, uma vez que os linfócitos e macrófagos são observados nesse tipo de infecção.', 1050),
(145, 'Intestino', 'A hiperplasia de enterócitos e células caliciformes, lise das vilosidade intestinais e necrose das vilosidades intestinais podem ser causadas por agentes químicos, físicos ou biológicos. Porém, a visualização de eosinófilos sugere infecção biológica.', 1050),
(146, 'Fígado', 'A inflamação por linfócitos e monócitos sugere uma infecção biológica. A degeneração macrogoticular de hepatócitos pode ser causada por excesso de gordura na dieta ou intoxicação química.', 1050),
(147, 'Brânquias', 'A hiperplasia de células epiteliais pode ser causada por agentes biológicos, químicos ou físicos. No entanto, a visualização de cocos bacterianos sugere que as lesões foram causadas por bactérias.', 1062),
(148, 'Baço', 'A hiperplasia de polpa branca e necrose de coagulação sugere infecção biológica, uma vez que os linfócitos são encontrados nesse tipo de infecção.', 1062),
(149, 'Cérebro', 'A inflamação por linfócitos sugere uma infecção biológica, uma vez que os linfócitos são encontrados nesse tipo de infecção. A visualização de cocos bacterianos sugere que a inflamação foi causada pela presença bacteriana.', 1062),
(150, 'Fígado', 'A necrose de coagulação de hepatócitos pode ser causada por agentes químicos, físicos ou biológicos. A degeneração macrogoticular de hepatócitos pode ser causada por excesso de gordura na dieta ou intoxicação química.', 1062),
(151, 'Olho', 'Sem alteração patológica digna de nota.', 1062),
(152, 'Rim', 'A necrose de coagulação tubular pode ser causada por agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos sugere que a lesão foi causada por bactérias.', 1062),
(153, 'Bexiga natatória', 'Sem alteração patológica digna de nota.', 1062),
(154, 'Intestino', 'A necrose de coagulação das vilosidades intestinais pode ser causada por agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos sugere que a lesão foi causada por bactérias.', 1062),
(155, 'Músculo esquelético', 'Embora não tenha sido observada lesão, foram notados cocos bacterianos.', 1062),
(156, 'Estômago', 'A congestão e a presença de eosinófilos podem ser causadas por um agente biológico, uma vez que os eosinófilos são encontrados em infecções biológicas.', 1064),
(157, 'Coração', 'A inflamação por linfócitos pode ser causada por agentes biológicos, uma vez que os linfócitos são encontrados nesse tipo de infecção.', 1064),
(158, 'Fígado', 'A congestão pode ser causada por agentes químicos, físicos ou biológicos. A degeneração macrogoticular de hepatócitos pode ser causada por excesso de gordura na dieta ou intoxicação química.', 1064),
