(265, 'Rim', 'A hemorragia, inflamação e degeneração hidrópica tubular podem ser causadas por agentes biológicos, uma vez que os linfócitos são encontrados nesse tipo de infecção. Além disso, foram vistas colônias bacterianas o que reafirma que as lesões foram causadas por agentes biológicos.', 1155),
(266, 'Intestino', 'A lise das vilosidades intestinais, inflamação, células gigantes e hemorragia podem estar sendo causadas por agentes biológicos, uma vez que os linfócitos e células gigantes são encontrados nesse tipo de infecção. Sugere-se pesquisar Mycobacterium, uma vez que as células gigantes são muito encontradas nesse tipo de infecção. ', 1155),
(267, 'Fígado', 'A presença de melanomacrófagos e congestão podem ser causadas por agentes biológicos, químicos ou físicos. No entanto, a visualização de colônias bacterianas sugere que as lesões foram causadas por bactérias. A degeneração macrogoticular de hepatócitos pode ser causada por excesso de gordura na dieta ou intoxicação química.', 1155),
(268, 'Intestino', 'A inflamação, células gigantes e congestão podem ser causadas por agentes químicos, físicos ou biológicos. No entanto, a visualização de estruturas sugestivas de microsporídeos e megalocytivírus sugerem que as lesões foram causadas por fungos e vírus. A visualização de células gigantes sugere infecção por Mycobacterium, o que pode ser investigado com técnicas molecular e microbiológicas convencionais.', 1156),
(269, 'Cérebro', 'A inflamação por linfócitos e congestão podem ser causadas por agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos sugere que as lesões foram causadas por bactérias.', 1156),
(270, 'Brânquias', 'A hiperplasia de células epiteliais, fusionamento lamelar e hemorragia podem ser causadas por agentes químicos, físicos ou biológicos. No entanto, a visualização de monogeneas e cocos bacterianos sugere que as lesões podem ser causadas por bactérias e parasitas.', 1156),
(271, 'Fígado', 'A congestão intensa pode ser causada por agentes químicos, físicos ou biológicos.', 1156),
(272, 'Rim', 'A hemorragia, inflamação por linfócitos e necrose tubular podem ser causadas por agentes químicos, físicos ou biológicos. No entanto, a visualização de trematóides e cocos bacterianos demonstra que as lesões foram causadas por parasitas e bactérias.', 1156),
(273, 'Intestino', 'Embora não tenha sido observada lesão, foram notadas estruturas sugestivas de Megalocytivírus.', 1157),
(274, 'Baço', 'A hiperplasia de polpa branca pode estar sendo causada por agentes biológicos, uma vez que os linfócitos são observados nesse tipo de infecção. Além disso, foram notadas bactérias, reafirmando que as lesões foram causadas por agentes biológicos.', 1157),
(275, 'Fígado', 'A congestão e inflamação por linfócitos pode estar sendo causada por agentes biológicos, uma vez que os linfócitos são observados nesse tipo de infecção.', 1157),
(276, 'Rim', 'A inflamação por linfócitos, hipertrofia das células epiteliais tubulares e hemorragia podem ser causadas por agentes biológicos, uma vez que os linfócitos são encontrado nesse tipo de infecção. Além disso, a presença de colônias bacterianas e estruturas sugestivas de microsporídeos sugerem que as lesões foram causadas por fungos e bactérias.', 1157),
(277, 'Brânquias', 'A metaplasia, a hiperplasia de células epiteliais e congestão podem ser causadas por agentes químicas, físicas ou biológicas. No entanto, a visualização de monogeneas sugere que as lesões foram causadas por parasitas.', 1157),
(278, 'Cérebro', 'A congestão e inflamação por linfócitos pode estar sendo causada por agentes biológicos, uma vez que os linfócitos são observados nesse tipo de infecção.', 1157),
(279, 'Brânquias', 'A metaplasia, hiperplasia de células epiteliais, fusionamento lamelar, edema lamelar, aneurisma e telangiectasia podem ser causadas por agentes químicos, físicos ou biológicos. No entanto, a visualização de Monogenea e estruturas sugestivas de protozoários demonstram que as lesões foram causadas por parasitas.', 1151),
(280, 'Brânquias', 'A metaplasia, hiperplasia de células epiteliais, edema do filamento branquial, eosinófilos, aneurisma e congestão podem estar sendo causados por agentes biológicos, uma vez que os eosinófilos são encontrados nesse tipo de infecção. Essa hipótese é reafirmada pela visualização de estruturas sugestivas de protozoários e Monogenea. Também foram notados granulomas que podem ser formados por parasitas.', 1152),
(281, 'Estômago', 'A presença de eosinófilos sugere infecção biológica ou resposta alérgica.', 1165),
(282, 'Rim', 'A hemorragia, degeneração hidrópica tubular e inflamação por linfócitos podem ser causadas por agentes biológicos, uma vez que os linfócitos são encontrados nesse tipo de infecção.', 1165),
(283, 'Baço', 'A hiperplasia de polpa branca sugere infecção biológica, uma vez que os linfócitos são encontrados nesse tipo de infecção.', 1165),
(284, 'Intestino', 'A lise das vilosidades intestinais e raros eosinófilos sugere infecção biológica, uma vez que os eosinófilos são observados nesse tipo de infecção. Além disso, foram notadas estruturas sugestivas de mixozoários e megalocytivírus, reafirmando que parasitos e vírus causaram as lesões.', 1165),
(285, 'Brânquias', 'A hiperplasia de células epiteliais, metaplasia e congestão podem ser causadas por agentes químicos, físicos ou biológicos. No entanto, a visualização de Monogenea, Trichodina e cistos de epiteliocystis sugerem que as lesões foramcausadas por parasitas e bactérias. Vale ressaltar que foram observados inúmeros cistos em todas as amostras branquiais analisadas.', 1165),
(286, 'Fígado', 'A necrose de coagulação pode ser causada por agentes químicos, físicos ou biológicos. No entanto, a visualização de estruturas sugestivas de mixozoários sugere que as lesões foram causadas por parasitas.', 1165),
(287, 'Olho', 'Não foram observadas alterações histopatológicas dignas de nota.', 1164),
(288, 'Músculo esquelético', 'A hiperplasia de miócitos pode ser causada por agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos sugere que a lesão pode ter sido causada por bactérias.', 1164),
(289, 'Rim', 'A degeneração hidrópica tubular e inflamação por linfócitos podem ser causadas por agentes biológicos, uma vez que os linfócitos são encontrados nesse tipo de infecção. Além disso, foram notadas colônias bacterianas, o que reafirma que as lesões foram causadas por bactérias.', 1164),
(290, 'Brânquias', 'A hiperplasia de células epiteliais e de Goblet e fusionamento lamelar podem ser causadas por agentes químicos, físicos ou biológicos.', 1164),
(291, 'Fígado', 'A congestão pode ser causada por agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos sugere que as lesões foram causadas por bactérias. A degeneração macrogoticular de hepatócitos sugere excesso de gordura na dieta ou intoxicação química.', 1164),
(292, 'Cérebro', 'A inflamação por linfócitos  pode ser causada por agentes biológicos, uma vez que os linfócitos são encontrados nesse tipo de infecção. Além disso, foram notadas colônias bacterianas, o que reafirma que as lesões foram causadas por bactérias.', 1164),
(293, 'Intestino', 'A necrose de coagulação das vilosidades intestinais pode ser causada por agentes químicos, físicos ou biológicos. No entanto, a visualização de estruturas sugestivas de mixosporídeos sugere que a lesão foi causada por parasitas.', 1163),
(294, 'Músculo esquelético', 'Embora não tenha sido observada lesão, foram notados cocos bacterianos.', 1163),
(295, 'Olho', 'Não foram notadas alterações histopatológicas dignas de nota.', 1163),
(296, 'Fígado', 'A congestão pode ser causada por agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos indica que a lesão foi causada por bactérias. A degeneração macrogoticular de hepatócitos indica excesso de gordura na dieta ou intoxicação química.', 1163),
(297, 'Baço', 'A hiperplasia de polpa branca pode ter sido causada por agentes biológicos, uma vez que os linfócitos são encontrados nesse tipo de infecção. Além disso, a visualização de cocos bacterianos sugerem que a lesão foram causadas por bactérias.', 1163),
(298, 'Rim', 'A hemorragia e inflamação podem ser causadas por agentes biológicos, uma vez que os linfócitos são observados nesse tipo de infecção. Além disso, foram notadas colônias bacterianas que evidenciam que as lesões foram causadas por bactérias.', 1163),
(299, 'Cérebro', 'A inflamação pode ter sido causada por agentes biológicos, uma vez que os linfócitos são encontrados nesse tipo de infecção. Além disso, a visualização de cocos bacterianos sugerem que a lesão foram causadas por bactérias.', 1163),
(300, 'Brânquias', 'A hiperplasia de células epiteliais e fusionamento lamelar podem ser causadas por agentes químicos, biológicos ou físicos. No entanto, a visualização de cocos bacterianos sugere que as lesões foram causadas por bactérias.', 1163),
(301, 'Intestino', 'A necrose de coagulação das vilosidades intestinais, lise das vilosidades intestinais e destruição tecidual acentuada podem ser causadas por agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos e estruturas sugestivas de mixozoários sugerem que as lesões possam ter sido causadas por bactérias e parasitos.', 1184),
(302, 'Estômago', 'A presença de eosinófilos indica infecção biológica, uma vez que os eosinófilos são encontrados nesse tipo de infecção. Além disso, foram notadas estruturas sugestivas de mixosporídeos, sugerindo que as lesões possam ter sido causadas por parasitas.', 1183),
(303, 'Brânquias', 'A hiperplasia de células epiteliais, congestão e metaplasia podem ser causadas por agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos, Monogenea, Trichodina e Ichichthyophthirius multifiliis sugerem que as lesões foram causadas por bactérias e parasitos.', 1183),
(304, 'Fígado', 'A presença de centros-melanomacrófagos e congestão indicam infecção biológica, uma vez que os macrófagos são encontrados em infecção biológica. Além disso, foram encontrados cocos bacterianos e estruturas sugestivas de mixosporídeos, indicando que as lesões foram causadas por bactérias e parasitos.', 1183),
(305, 'Intestino', 'A necrose de coagulação das vilosidades intestinais, hiperplasia de enterócitos, eosinófilos e atrofia das vilosidades intestinais  indicam infecção biológica, uma vez que os eosinófilos são encontrados nesse tipo de infecção. Além disso, foram notadas estruturas sugestivas de mixosporídeos e microsporídeos, sugerindo que as lesões possam ter sido causadas por parasitas e fungos.', 1183),
(306, 'Baço', 'A hiperplasia acentuada de centros-melanomacrófagos e vacuolização de polpa branca indicam infecção biológica, uma vez que os macrófagos são observados nesse tipo de infecção.', 1183),
(307, 'Coração', 'Embora não tenha sido observada lesão, foram notados inúmeros mixosporídeos.', 1183),
(308, 'Rim', 'A hemorragia pode ser causada por traumas ou lesão vascular por agentes biológicos. A degeneração hidrópica tubular indica persistência de um agente químico, físico ou biológico. A inflamação por linfócitos e presença de melanomacrófagos sugere infecção biológica, uma vez que essas células são combatem agentes biológicos agressores. Além disso, foram notados cocos bacterianos, evidenciando que as lesões possam ter sido causadas por bactérias.', 1185),
(309, 'Estômago', 'A congestão pode ser causadas por intoxicação química, trauma ou persistência de agentes biológicos.', 1185),
(310, 'Brânquias', 'O aneurisma pode ser causada por trauma, intoxicação química persistente ou agressão ao endotélio por um agente biológico. A metaplasia indica persistência longa de um agressor químico, físico ou biológico. A hiperplasia de células epiteliais demonstra que há agressão tecidual e celular que pode ser por um agente químico, físico ou biológico. A presença de melanomacrófagos indica infecção biológica, uma vez que essas células são frequentes nesse tipo de infecção. Além disso, foram notados raros monogenéticos e trichodina, evidenciando que as lesões podem estar sendo causadas por parasitas.', 1185),
(311, 'Coração', 'A congestão é observada na inflamação que pode ser por agentes químicos, físicos ou biológicos, mas como foram notados linfócitos, sugere-se infecção biológica, uma vez que os linfócitos são frequentemente recrutados pelo organismo para combater patógenos. Essa hipótese é reafirmada pela visualização de cocos bacterianos.', 1185),
(312, 'Intestino', 'A congestão pode ser causadas por intoxicação química, trauma ou persistência de agentes biológicos. No entanto, a visualização de cocos bacterianos demonstram que a lesão pode ter sido causado por bactérias.', 1185),
(313, 'Cérebro', 'A congestão e hemorragia podem ser causadas por lesão física (trauma) ou toxicidade por alguma toxina ou produto químico. Além disso, a congestão é observada na inflamação que pode ser por agentes químicos, físicos ou biológicos, mas como foram notados linfócitos e eosinófilos, sugere-se infecção biológica, uma vez que os linfócitos e eosinófilos são frequentemente recrutados pelo organismo para combater patógenos. Essa hipótese é reafirmada pela visualização de cocos bacterianos.', 1185),
(314, 'Fígado', 'A degeneração macrogoticular de hepatócitos pode ser causada por intoxicação química ou excesso de gordura na dieta. a congestão é observada na inflamação que pode ser por agentes químicos, físicos ou biológicos, mas como foram notados linfócitos e eosinófilos, sugere-se infecção biológica, uma vez que os linfócitos e eosinófilos são frequentemente recrutados pelo organismo para combater patógenos. Essa hipótese é reafirmada pela visualização de cocos bacterianos. a congestão é observada na inflamação que pode ser por agentes químicos, físicos ou biológicos, mas como foram notados linfócitos e eosinófilos, sugere-se infecção biológica, uma vez que os linfócitos e eosinófilos são frequentemente recrutados pelo organismo para combater patógenos. Essa hipótese é reafirmada pela visualização de cocos bacterianos. A congestão é observada na inflamação que pode ser por agentes químicos, físicos ou biológicos, mas como foram notados linfócitos, sugere-se infecção biológica, uma vez que os linfócitos são frequentemente recrutados pelo organismo para combater patógenos. Essa hipótese é reafirmada pela visualização de cocos bacterianos. A congestão é observada na inflamação que pode ser por agentes químicos, físicos ou biológicos, mas como foram notados linfócitos, sugere-se infecção biológica, uma vez que os linfócitos são frequentemente recrutados pelo organismo para combater patógenos. Essa hipótese é reafirmada pela visualização de cocos bacterianos.A congestão é observada na inflamação que pode ser por agentes químicos, físicos ou biológicos, mas como foram notados linfócitos, sugere-se infecção biológica, uma vez que os linfócitos são frequentemente recrutados pelo organismo para combater patógenos. Essa hipótese é reafirmada pela visualização de cocos bacterianos.A congestão é observada na inflamação que pode ser por agentes químicos, físicos ou biológicos, mas como foram notados linfócitos, sugere-se infecção biológica, uma vez que os linfócitos são frequentemente recrutados pelo organismo para combater patógenos. Essa hipótese é reafirmada pela visualização de cocos bacterianos. A congestão pode ser causada por um quadro de intoxicação química, trauma ou agente biológico persistente no organismo. Ademais, foram observados melanomacrófagos e eosinófilos que são frequentes em infecção biológica, uma vez que combatem agentes biológicos agressivos ao organismo.', 1185),
(315, 'Baço', 'A hemorragia pode ter sido causado por trauma ou lesão vascular oriunda de infecção biológica persistência. No entanto, a visualização de centros-melanomacrófagos em grandes quantidades demonstram que as lesões estão sendo causadas pela presença de agentes biológicos, uma vez que essas células são frequentes no combate desse tipo de infecção.', 1185),
(316, 'Baço', 'A hemorragia pode ser causada por uma lesão vascular ocasionada por trauma ou algum agente biológico que lesionou o endotélio. A degeneração vacuolar de polpa branca pode ser causada pela agressão persistente de um agente biológico, químico ou físico. No entanto, a visualização de centros-melanomacrófagos indica persistência de um agente biológico, uma vez que essas células combatem infecção biológica. Além disso, foram visualizados cocos bacterianos, evidenciando que as lesões possam ter sido causadas por bactérias.', 1186),
(317, 'Brânquias', 'A metaplasia é uma lesão ocasionada pela persistência de um agente biológico, químico ou físico por um longo período. O edema do filamento branquial e hiperplasia de células epiteliais são causadas pela agressão contínua de um agente químico, físico ou biológico. No entanto, a visualização de eosinófilos sugere que as lesões estão sendo causados por agentes biológicos, uma vez que essas células recrutam células de defesa que combatem infecção. Além disso, a visualização de cocos bacterianos, estruturas basofílicas sugestivas de mixosporídeos, Monogenea e inúmeros Trichodinas demonstram que as lesões foram causadas por bactérias e parasitas.', 1186),
(318, 'Cérebro', 'A hemorragia pode ser causada por uma lesão vascular ocasionada por trauma ou algum agente biológico que lesionou o endotélio.  A inflamação intensa por linfócitos em todas as camadas sugere infecção biológica, uma vez que essas células combatem infecção biológica. Além disso, foram notados cocos bacterianos em grande quantidade, o que reafirma que as lesões foram causadas por bactérias.', 1186),
(319, 'Rim', 'A hemorragia pode ser causada por uma lesão vascular ocasionada por trauma ou algum agente biológico que lesionou o endotélio.  A degeneração hidrópica tubular indica persistência de agressão por um agente químico, físico ou biológico. A inflamação intensa por linfócitos e presença de eosinófilos e melanomacrófagos sugere infecção biológica, uma vez que essas células combatem infecção biológica. Além disso, foram notados cocos bacterianos em grande quantidade, o que reafirma que as lesões foram causadas por bactérias. A presença de material calcificado no lúmen tubular indica ingestão de minerais em excesso da água.', 1186),
(320, 'Coração', 'A hemorragia pode ser causada por uma lesão vascular ocasionada por trauma ou algum agente biológico que lesionou o endotélio. A hiperplasia de miócitos pode ser causada pela persistência de agente biológico, intoxicação química ou medicamentosa ou trauma. No entanto, a visualização de estruturas sugestivas de esporos de fungos evidenciam que as lesões foram causadas por fungos.', 1186),
(321, 'Estômago', 'A inflamação por linfócitos e eosinófilos em todas as camadas sugere infecção biológica, uma vez que essas células combatem infecção biológica. Além disso, foram notadas estruturas sugestivas de microsporídeos, demonstrando que as lesões foram causadas por fungos.', 1186),
(322, 'Intestino', 'A lise das vilosidades intestinais e hiperplasia de enterócitos podem ser causadas pela persistência de um agente químico, físico ou biológico. A presença de eosinófilos indica infecção biológica, uma vez que essas células recrutam células de defesa que combatem infecção. Além disso, foram notadas estruturas sugestivas de microsporídeos, indicando que as lesões foram causadas por fungos.', 1186),
(323, 'Fígado', 'A congestão é comum em processo inflamatório que pode ser causado em intoxicações químicas, traumas e infecção biológica.  No entanto, a visualização de eosinófilos sugere infecção biológica, uma vez que essas células recrutam células de defesa que combatem infecção. A degeneração macrogoticular de hepatócitos pode ser causada por excesso de gordura na dieta ou intoxicação química.', 1186),
(324, 'Estômago', 'A hemorragia pode ser causada pela lesão vascular ocasionada por trauma ou agressão ao endotélio por um agente biológico. No entanto, a inflamação por linfócitos indica presença de agente biológico, uma vez que essas células combatem esse tipo de infecção. Além disso, foram notados trematódeos e cocos bacterianos, sugerindo que as lesões foram causadas por bactérias e parasitos.', 1187),
(325, 'Baço', 'A hemorragia pode ser causada pela lesão vascular ocasionada por trauma ou agressão ao endotélio por um agente biológico. No entanto, a presença de inúmeros centros-melanomacrófagos indica presença de agente biológico, uma vez que essas células combatem esse tipo de infecção. ', 1187),
(326, 'Brânquias', 'A hiperplasia de células epiteliais, fusionamento lamelar e metaplasia demonstram que há persistência por um longo período de agressão tecidual que pode ser causada por agentes biológicos, químicos ou físicos. A visualização de cocos bacterianos, Monogenea e inúmeras Trichodinas evidenciam que as lesões foram causadas por parasitas e bactérias. Além disso, foi notado granuloma contendo bactérias.', 1187),
(327, 'Intestino', 'A hemorragia pode ser causada pela lesão vascular ocasionada por trauma ou agressão ao endotélio por um agente biológico.  A lise das vilosidades intestinais e necrose de coagulação das vilosidades intestinais podem ser causadas pela agressão contínua ao epitélio intestinal, seja por agentes químicos, físicos ou biológicos. No entanto, foram notadas estruturas sugestivas de microsporídeos e cocos bacterianos, sugerindo que as lesões foram causadas por bactérias e fungos.', 1187),
(328, 'Fígado', 'A congestão pode ser causada pela lesão vascular ocasionada por trauma ou agressão ao endotélio por um agente biológico. A presença de hemossiderina demonstra lesão vascular. No entanto, a inflamação por linfócitos indica presença de agente biológico, uma vez que essas células combatem esse tipo de infecção. Além disso, foram notados cocos bacterianos, sugerindo que as lesões foram causadas por bactérias. A degeneração de macrogoticular de hepatócitos pode ser causada por excesso de gordura na dieta ou intoxicação química.', 1187),
(329, 'Brânquias', 'A presença de inúmeros aneurismas demonstra que a lesão vascular está sendo muito intensa, podendo ser causada por traumas, intoxicações químicas ou medicamentosas ou infecção biológica. A hiperplasia de células epiteliais e metaplasia também evidenciam persistência do agente causador de lesão tecidual que pode ser de origem biológica, física ou química. No entanto, a visualização de inúmeras colônias bacterianas contendo cocos, Trichodinas e estruturas binucleadas sugestivas de mixosporídeos evidenciam que as lesões foram causadas por parasitas e bactérias.', 1188),
(330, 'Intestino', 'A hiperplasia acentuada de enterócitos demonstra que está tendo agressão contínua, podendo ser de origem biológica, química ou física. A visualização de raros eosinófilos sugere infecção biológica, uma vez que essas células são observadas em alguns processos infecciosos. Essa hipótese é reafirmada pela visualização de cocos bacterianos, demonstrando que as lesões possam estar sendo causadas por bactérias.', 1188),
(331, 'Fígado', 'A congestão e pigmento de hemossiderina são causadas por lesão vascular e de hemaceas, podendo ser causada por traumas, intoxicações químicas ou medicamentosas ou infecção biológica. No entanto, a visualização de cocos bacterianos demonstram que as lesões foram causadas por bactérias. A degeneração macrogoticular de hepatócitos pode ser causada por intoxicação química ou excesso de gordura na dieta.', 1188),
(332, 'Baço', 'A hemorragia intensa indica lesão vascular, podendo ser causada por traumas, intoxicações químicas ou medicamentosas ou infecção biológica. No entanto, a observação de inflamação por linfócitos, hiperplasia acentuada de polpa branca e de centros-melanomacrófagos sugerem infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combate de agentes biológicos agressivos ao organismo.', 1188),
(333, 'Intestino', 'A lise das vilosidades intestinais e hiperplasia de enterócitos podem ser causadas pela persistência e agressão tecidual por um trauma, agentes biológicos ou intoxicação química. No entanto, a visualização de eosinófilos sugere que possa estar acontecendo alguma reação alérgica ou infecção biológica, uma vez que essas células são comuns nesse processo. Além disso, foram notados cocos bacterianos, estruturas sugestivas de microsporídeos e mixosporídeos, evidenciando que as lesões foram causadas por bactérias, parasitos e fungos.', 1189),
(334, 'Baço', 'A hemorragia pode ser causada por um trauma que lesionou os vasos sanguíneos, ou lesão persistente vascular por um agente biológico ou intoxicação química, pois alguns produtos destroem o endotélio vascular. No entanto, a visualização de cocos bacterianos sugere que as lesões foram causadas por bactérias.', 1189),
(335, 'Estômago', 'A inflamação moderada por linfócitos e eosinófilos pode estar sendo causada por infecção biológica, tendo em vista que essas células combatem esse tipo de patógeno.', 1189),
(336, 'Cérebro', 'A hemorragia pode ser causada por um trauma que lesionou os vasos sanguíneos, ou lesão persistente vascular por um agente biológico ou intoxicação química, pois alguns produtos destroem o endotélio vascular. A inflamação intensa por linfócitos e eosinófilos em todas as camadas demonstra uma infecção biológica agressiva, uma vez que essas células combatem agentes infecciosos. Essa hipótese é reafirmada pela visualização de cocos bacterianos na meninge.', 1189),
(337, 'Músculo esquelético', 'A hiperplasia de miócitos pode ser causada pela agressão contínua de um agente químico, físico ou biológico. No entanto, a visualização de cocos bacterianos evidencia que a lesão foi causada por bactérias.', 1189),
(338, 'Fígado', 'A congestão é a estase de sangue no vaso sanguíneo que pode ser causada por produtos químicos, lesão contínua por um agente biológico ou trauma. No entanto, a visualização de eosinófilos sugere um quadro alérgico ou presença de agente biológico, uma vez que essas células atuam nesses dois processos. Porém, a visualização de granuloma sendo formado para isolar bactérias e observação de cocos bacterianos sugere que as lesões foram causadas por bactérias. Além disso, foi notada degeneração microgoticular de hepatócitos que pode ser causada por excesso de gordura na dieta ou intoxicação química.', 1189),
(339, 'Brânquias', 'A hiperplasia de células epiteliais, fusionamento lamelar e metaplasia indicam agressão tecidual persitente por um longo período, podendo ser causada por agentes químicos, físicos ou biológicos. A destruição do epitélio branquial pode ser causada por um trauma, infecção biológica intensa ou intoxicação química. O aneurisma e congestão moderada podem ser formadas por intoxicação química ou infecção biológica. No entanto, a inflamação intensa por linfócitos e monócitos indica infecção biológica, uma vez que essas células são recrutadas para combater a infecção. A deposição de fibrina demonstra que a infecção é crônica. Essa hipótese é reafirmada pela visualização de cocos bacterianos, inúmeros Trichodina e cisto sugestivo de epiteliocystis, sugerindo que as lesões podem ser causadas por parasitas e bactérias.', 1190),
(340, 'Bexiga natatória', 'Embora não tenha sido observada lesão, foram notados cocos bacterianos.', 1191),
(341, 'Rim', 'A degeneração hialina tubular indica distúrbio circulatório ou intoxicação química, principalmente por toxinas. A picnose das células tubulares indica início de morte celular que pode ser causada por toxinas ou agentes biológicos. A inflamação por linfócitos e eosinófilos reafirma a hipótese que as lesões estão sendo causadas por agentes biológicos, uma vez que essas células são recrutadas para combater agentes biológicos. Além disso, foram notados cocos bacterianos, o que sugere que as lesões foram causadas por bactérias.', 1191),
(342, 'Intestino', 'A lise das vilosidades intestinais pode ser causada por um trauma ou perfuração de um agente biológico. A necrose de coagulação das vilosidades intestinais indica persistência de agressão celular e tecidual que pode ser causada por agentes químicos, físicos ou biológicos. A hiperplasia de enterócitos indica agressão celular que pode ser causada pela presença de agentes químicos, físicos ou biológicos. A visualização de eosinófilos sugere um quadro alérgico ou infecção biológica. ', 1191),
(343, 'Baço', 'Não foram observadas alterações histopatológicas dignas de nota.', 1191),
(344, 'Brânquias', 'A hiperplasia de células epiteliais, metaplasia e fusionamento lamelar demonstra que há algum agressor químico, físico ou biológico persistente causando agressão celular e tecidual por um longo período de tempo. No entanto, a visualização de inúmeros Trichodinas e cocos bacterianos evidencia que as lesões foram causadas por bactérias e parasitas.', 1191),
(345, 'Fígado', 'A congestão indica acúmulo de sangue nos vasos sanguíneos que pode ser devido a uma intoxicação química, presença de um corpo estranho ou ainda infecção biológica. A visualização de cocos bacterianos sugere que a lesão foi causada por bactérias. A degeneração microgoticular de hepatócitos pode ser causada por excesso de gordura ou intoxicação química.', 1191),
(346, 'Estômago', 'A lise do epitélio gástrico pode indicar trauma ou perfuração por algum agente biológico. A visualização de eosinófilos sugere um quadro alérgico ou infecção biológica. ', 1191),
(347, 'Baço', 'A hiperplasia de polpa branca, presença de centros-melanomacrófagos, eosinófilos e inflamação por linfócitos e monócitos sugerem infecção biológica, uma vez que os linfócitos, macrófagos, eosinófilos e monócitos são células recrutadas por citocinas para combater infecção biológica. Essa hipótese é reafirmada pela visualização de cocos bacterianos, granulomas e estruturas sugestivas de Megalocytivírus.', 1215),
(348, 'Intestino', 'A hiperplasia de enterócitos acontece pela persistência da agressão tecidual por agentes químicos, físicos ou biológicos. A presença de eosinófilos ainda indica infecção biológica ou quadro alérgico. No entanto, a visualização de cocos bcaterianos e inúmeras estruturas sugestivas de Megalocytivírus sugerem que as lesões foram causadas por bactérias e vírus.', 1215),
(349, 'Brânquias', 'A telangiectasia é o acúmulo de sangue nos pequenos vasos causando dilatação que pode ser ocasionado por agentes químicos ou biológicos. A hiperplasia de células epiteliais e fusionamento lamelar ocorrem pela constante agressão tecidual por agente químicos, físicos ou biológicos. No entanto, a visualização decocos bacterianos e inúmeros Trichodinas demonstram que as lesões possam ter sido causadas por bactérias e parasitas.', 1215),
(350, 'Fígado', 'A congestão é a estase de sangue nos vasos sanguíneos que pode ser devido a componentes químicos (excesso de medicamento, toxinas), traumas ou infecção biológica. Os eosinófilos indicam infecção biológica ou quadro alérgico. No entanto, a visualização de inúmeros cocos bacterianos e estruturas sugestivas de Megalocytivírus sugerem que as lesões foram causadas por bactérias e vírus. A visualização de degeneração microgoticular de hepatócitos pode ser causada por excesso de gordura na dieta ou intoxicação química.', 1215),
(351, 'Estômago', 'A inflamação por linfócitos e eosinófilos indica infecção biológica, uma vez que essas células estão envolvidas no combate de infecção biológica. Essa hipótese é reafirmada pela visualização de estruturas sugestivas de Megalocytivírus.', 1215),
(352, 'Brânquias', 'A congestão e aneurismas demonstra que o acúmulo de sangue possa estar sendo causado por agentes químicos, físicos ou biológicos, porém a visualização de estruturas sugestivas de mixosporídeos sugere que as lesões vasculares foram causadas por parasitas. Também foi notada hiperplasia de células epiteliais e fusionamento lamelar indicam agressão persistente que pode ser devido a presença de agentes químicos, físicos ou biológicos. A presença de eosinófilos sugere infecção biológica ou quadro alérgico. No entanto, a visualização de inúmeros Trichodinas e cocos bacterianos sugere que as lesões foram causadas por bactérias e parasitas.', 1214),
(353, 'Brânquias', 'A congestão e formação de aneurismas é o acúmulo de sangue nos vasos que pode ser ocasionado por trauma, compostos químicos ou infecção biológica. A hiperplasia de células epiteliais, lise do epitélio branquial e metaplasia demonstram que há persistência de agressão tecidual por um longo período de tempo que pode ser de origem biológica, química ou física. A inflamação por linfócitos e eosinófilos são recrutadas pelo organismo para combater infecção biológica. Essa hipótese é reafirmada pela visualização de cocos bacterianos, Trichodina, Monogenea e cisto sugestivo de epiteliocystis.', 1216),
(354, 'Baço', 'A hiperplasia de polpa branca é o aumento de linfócitos no órgão, o que indica infecção biológica, uma vez que essas células combatem agentes biológicos.', 1217),
(355, 'Músculo esquelético', 'A hiperplasia de miócitos indica agressão tecidual que pode ser de origem biológica, química ou física. No entanto, a visualização de cocos bacterianos sugere que a leão foi causada por bactérias.', 1217),
(356, 'Brânquias', 'A hiperplasia de células epiteliais e fusionamento lamelar secundário indica persistência na agressão tecidual que pode ser de origem biológica, química ou física. No entanto, a visualização de cocos bacterianos sugere que as lesões foram causadas por bactérias.', 1217),
(357, 'Estômago', 'Não foram observadas alterações histopatológicas dignas de nota. ', 1217),
(358, 'Fígado', 'A degeneração macrogoticular de hepatócitos pode ser causado por intoxicação química ou excesso de gordura na dieta.', 1217),
(359, 'Cérebro', 'A inflamação intensa por linfócitos sugere que infecção biológica, uma vez que essas células combatem infecção biológica. Além disso, a visualização de cocos bacterianos sugere que a inflamação foi gerada pela presença de bactérias.', 1217),
(360, 'Intestino', 'A necrose de coagulação das vilosidades intestinais ocorre devido a agressão tecidual persistente que pode ser causada por agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos sugere que as lesões foram causadas por bactérias.', 1217),
(361, 'Coração', 'A hemorragia é oriundo da lise vascular pode ser causada por trauma, intoxicação química ou infecção biológica. A vacuolização do miocárdio pode ser devido a excesso de produtos químicos no ambiente, agentes biológicos ou trauma. A visualização de cocos bacterianos sugere que as lesões estão sendo causadas por bactérias.', 1217),
(362, 'Bexiga natatória', 'Embora não tenha sido observado lesão, foram notados cocos bacterianos.', 1217),
(363, 'Rim', 'A necrose de coagulação tubular e degeneração hidrópica tubular são causadas pela agressão tecidual e celular persistente que pode ser oriundo da presença de agentes biológicos, químicos ou físicos. No entanto, a visualização de cocos bacterianos sugere que as lesões foram causadas por bactérias.', 1217),
(364, 'Estômago', 'A necrose de coagulação é a morte celular que pode ser oriunda da agressão contínua por um agente bilógico, químico ou físico. No entanto, a visualização de estruturas sugestivas de esporos de fungos sugere que a lesão foi causada por fungos.', 1218),
(365, 'Intestino', 'A hiperplasia de enterócitos e necrose de coagulação demonstra que há persistência de agressão química, física ou biológica. A lise do epitélio pode ser devido a um trauma ou destruição do epitélio por um agente biológico. A presença de eosinófilos sugere que possa estar acontecendo um quadro alérgico ou infecção biológica. No entanto, a visualização de cocos bacterianos e estruturas sugestivas de fungos sugere que as lesões foram causadas por bactérias e fungos.', 1218),
(366, 'Coração', 'A hiperplasia de miócitos acontece devido a presença de um agressor químico, físico ou biológico persistente.', 1218),
(367, 'Brânquias', 'A hiperplasia de células epiteliais e fusionamento lamelar acontecem devido a persistência da agressão por agentes biológicos, químicos ou físicos. A lise do epitélio branquial pode ser devido a um trauma ou destruição por um agente biológico. Além disso, foram notados cocos bacterianos, Trichodina e estruturas sugestivas de esporos de fungos, sugerindo que as lesões foram causadas por bactérias, fungos e parasitas. Também foram notados granulomas com fungos, uma resposta do organismo para isolar o patógeno.', 1218),
(368, 'Fígado', 'A degeneração macrogoticular e microgoticular de hepatócitos ocorre por excesso de gordura na dieta ou intoxicação química. A  congestão é o acúmulo de sangue nos vasos sanguíneos que pode ser devido a uma intoxicação química, trauma ou infecção biológica. O edema é um dos fatores que indicam que se instalará uma inflamação que pode ser causada por infecção biológica, química ou física. A presença de eosinófilos sugere quadro alérgico ou infecção biológica. No entanto, a visualização de cocos bacterianos sugere que as lesões foram causadas por bactérias.', 1218),
(369, 'Baço', 'A hiperplasia de polpa branca e presença de eosinófilos indica infecção biológica, uma vez que essas células são recrutadas para combater infecção biológica. Além disso, foram notados cocos bacterianos, reafirmando que as lesões foram causadas por bactérias.', 1218),
(370, 'Baço', 'A hiperplasia de centros-melanomacrófagos e hiperplasia de polpa branca indicam infecção biológica, uma vez que os linfócitos e macrófagos são células que destroem agentes biológicos.', 1223),
(371, 'Fígado', 'A inflamação por linfócitos e eosinófilos indica infecção biológica, uma vez que essas células são recrutadas para combater agentes biológicos. O edema é uma alteração presente na inflamação que indica alteração vascular que pode ser devido a agentes químicos, físicos ou biológicos.', 1223),
(372, 'Intestino', 'A hemorragia ocorre pela lise vascular pode ser devido a um trauma, intoxicação química ou agente biológico. A lise das vilosidades intestinais pode ocorrer devido a um trauma ou infecção biológica. A atrofia das vilosidades intestinais e hiperplasia de enterócitos demonstra há persistência na agressão tecidual e celular que pode ser causada por agentes químicos, físicos ou biológicos.', 1223),
(373, 'Estômago', 'A inflamação por linfócitos e eosinófilos indica infecção biológica, uma vez que essas células são recrutadas para combater agentes biológicos.', 1223),
(374, 'Intestino', 'A necrose de coagulação das vilosidades intestinais é a agressão tecidual e celular persistente que gerou morte das células e perda da função do órgão. Nesse caso, pode ser causado por agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos sugere que a morte celular foi causada por bactérias.', 1224),
(375, 'Músculo esquelético', 'A hiperplasia de miócitos ocorre devido a irritação celular persistente que pode ser devido a agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos sugere que a lesão foi causada por bactérias.', 1224),
(376, 'Cérebro', 'A inflamação por linfócitos indica infecção biológica, uma vez que essas células combatem infecção. Além disso, foram notados cocos bacterianos, enfatizando que a inflamação foi gerada pela presença de bactérias.', 1224),
(377, 'Coração', 'A hemorragia intensa pode ser causado por um trauma vascular ou ainda ser um quadro de intoxicação química ou infecção biológica.', 1224),
(378, 'Rim', 'A inflamação por linfócitos indica infecção biológica, uma vez que essas células combatem infecção. Além disso, foram notados cocos bacterianos, enfatizando que a inflamação foi gerada pela presença de bactérias.', 1224),
(379, 'Olho', 'Não foram observadas alterações histopatológicas dignas de nota.', 1224),
(380, 'Ovários', 'Não foram observadas alterações histopatológicas dignas de nota.', 1224),
(381, 'Brânquias', 'A hiperplasia de células epiteliais e fusionamento lamelar são causadas pela agressão persistente de agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos sugere que as lesões foram causadas por bactérias.', 1224),
(382, 'Baço', 'A hemorragia intensa pode ser causado por um trauma vascular ou ainda ser um quadro de intoxicação química ou infecção biológica. No entanto, a visualização de cocos bacterianos sugere que a lesão foi causada por bactérias.', 1224),
(383, 'Estômago', 'A presença de eosinófilos pode indicar um quadro alérgico ou infecção biológica.', 1224),
(384, 'Fígado', 'A degeneração macrogoticular de hepatócitos pode ser devido a excesso de gordura na dieta ou intoxicação química.', 1224),
(385, 'Olho', 'Não foram observadas alterações histopatológicas dignas de nota.', 1225),
(386, 'Cérebro', 'A inflamação intensa por linfócitos indica infecção biológica, uma vez que essas células combatem agentes infecciosos. Além disso, foram notados cocos bacterianos que demonstram que a inflamação foi gerada pela presença de bactérias.', 1225),
(387, 'Brânquias', 'A hiperplasia de células epiteliais e fusionamento lamelar indicam persistência na agressão tecidual e celular que pode ser devido a presença de agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos sugere que as lesões foram causadas por bactérias.', 1225),
(388, 'Músculo esquelético', 'Embora não tenha sido observada lesão, foram notados cocos bacterianos.', 1225),
(389, 'Bexiga natatória', 'Não foram observadas alterações histopatológicas dignas de nota.', 1225),
(390, 'Rim', 'A degeneração hidrópica tubular pode ser causada pela agressão química, vascular, física ou biológica. No entanto, a visualização de cocos bacterianos sugere que a lesão foi causada por bactérias.', 1225),
(391, 'Fígado', 'A degeneração macrogoticular de hepatócitos pode ser devido a excesso de gordura na dieta ou intoxicação química.', 1225),
(392, 'Estômago', 'A necrose de coagulação é a morte celular devido a agressão persistente por um agente químico, físico ou biológico. No entanto, a visualização de cocos bacterianos sugere que a lesão foi causada por bactérias.', 1225),
(393, 'Baço', 'A hiperplasia de polpa branca indica infecção biológica, uma vez que os linfócitos são células envolvidas no combate de agentes biológicos. Além disso, foram notados granulomas que é um mecanismo do organismo isolar patógeno.', 1225),
(394, 'Intestino', 'A necrose de coagulação é a morte celular devido a agressão persistente por um agente químico, físico ou biológico.  A hiperplasia de enterócitos também indica irritação ao órgão que pode ser em decorrência de intoxicação química, infecção biológica ou trauma. ', 1225),
(395, 'Intestino', 'A hemorragia é o extravasamento de sangue do vaso sanguíneo pode ter sido por lise vascular, intoxicação química ou infecção biológica. A hiperplasia de enterócitos e atrofia das vilosidades intestinais indica agressão celular e tecidual persistente, podendo ser de origem biológica, química ou física. A lise das vilosidade intestinais pode ser devido a um trauma, intoxicação química ou infecção biológica. A presença de eosinófilos indica quadro alérgico ou infecção biológica. No entanto, a visualização de cocos bacterianos sugere que as lesões foram causadas por bactérias.', 1219),
(396, 'Estômago', 'A inflamação por linfócitos e eosinófilos sugerem infecção biológica, uma vez que essas células são recrutadas para combater essa infecção.', 1219),
(397, 'Baço', 'A hemorragia é o extravasamento de sangue pela lise vascular que pode ser devido a um trauma, infecção biológica ou intoxicação química. A hiperplasia acentuada de melanomacrófagos indica infecção biológica, uma vez que essas células combatem infecção biológica.', 1219),
(398, 'Fígado', 'A congestão é o acúmulo de sangue no vaso que pode ser devido a intoxicação química, biológica ou física. O edema é o extravasamento de líquido dos vasos sanguíneos, indicando inflamação. Fato observado nos órgãos analisados, demonstrando infecção biológica, uma vez que os linfócitos e eosinófilos, assim como os melanomacrófagos também observados, combatem infecção biológica. A visualização de cocos bacterianos ainda demonstram que as lesões foram causadas por bactérias.', 1219),
(399, 'Fígado', 'A congestão é o acúmulo de sangue no interior do vaso sanguíneo que pode ser devido a um trauma, infecção biológica ou intoxicação química. A hemossiderina é um pigmento formado pela lise de hemáceas que pode ser por um composto químico, agente biológico ou trauma. A degeneração macrogoticular de hepatócitos indica intoxicação química ou excesso de gordura na dieta.', 1226),
(400, 'Baço', 'A hemorragia intensa é causada pela lise dos vasos sanguíneos que pode ser devido a um trauma, infecção biológica ou intoxicação química. A hiperplasia de centros melanomacrófagos indica infecção biológica, uma vez que os macrófagos são células que combatem esse tipo de infecção.', 1226),
(401, 'Coração', 'A hiperplasia de miócitos e vacuolização do miocárdio indica agressão química, física ou biológica persistente. A presença de mastócitos indica infecção biológica, uma vez que essas células são recrutadas para combater infecção biológica. ', 1226),
(402, 'Estômago', 'A inflamação por linfócitos e eosinófilos indica infecção biológica, uma vez que essas células são observadas no combate de agentes biológicos nocivos ao organismo.', 1226),
(403, 'Brânquias', 'A hemorragia intensa é causada pela lise dos vasos sanguíneos que pode ser devido a um trauma, infecção biológica ou intoxicação química. A hiperplasia de células epiteliais, fusionamento lamelar secundário e metaplasia indica agressão física, química ou biológica persistente no tecido. A presença de eosinófilos indica infecção biológica ou um quadro alérgico. No entanto, a visualização de Monogenea indica que as lesões foram causadas por parasitas.', 1226),
(404, 'Ovários', 'A inflamação por linfócitos, eosinófilos e melanomacrófagos indica infecção biológica, uma vez que essas células estão envolvidas no combate de infecção biológica.', 1226),
(405, 'Intestino', 'A presença de eosinófilos sugere quadro alérgico ou infecção biológica.', 1226),
(406, 'Rim', 'A degeneração hidrópica tubular indica agressão tecidual e celular persistente que pode ser devido a agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos sugere que a lesão foi causada por bactérias.', 1227),
(407, 'Baço', 'A hiperplasia de polpa branca é o aumento do número de linfócitos, o que indica infecção biológica, uma vez que essas células são encontradas no combate de agentes biológicos nocivos ao organismo. A hemorragia é a lise vascular que pode ser devido a um trauma, intoxicação química ou infecção biológica.', 1227),
(408, 'Estômago', 'Não foram notadas alterações histopatológicas dignas de nota.', 1227),
(409, 'Intestino', 'A lise e necrose de coagulação das vilosidades intestinais indicam lesão persistente que pode ser devido a agentes químicos, físicos ou biológicos.', 1227),
(410, 'Brânquias', 'A hiperplasia de células epiteliais e fusionamento lamelar indicam lesão persistente que pode ser devido a agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos sugere que as lesões foram causadas por bactérias.', 1227),
(411, 'Cérebro', 'A inflamação por linfócitos indica infecção biológica, uma vez que essas células combatem agentes biológicos nocivos ao organismo. Além disso, foram notados cocos bacterianos, reafirmando que a inflamação foi gerada pela presença de bactérias.', 1227),
(412, 'Ovários', 'Não foram notadas alterações histopatológicas dignas de nota.', 1227),
(413, 'Olho', 'Não foram notadas alterações histopatológicas dignas de nota.', 1227),
(414, 'Músculo esquelético', 'Embora não tenha sido observada lesão histopatológica, foram notados cocos bacterianos.', 1227),
(415, 'Fígado', 'A degeneração macrogoticular de hepatócitos pode ser devido a intoxicação química ou excesso de gordura na dieta.', 1227),
(416, 'Baço', 'A hemorragia intensa é a liberação do sangue do interior dos vasos que pode ser devido a um trauma, intoxicação química ou infecção biológica. A presença de centros-melanomacrófagos sugere infecção biológica, uma vez que essas células combatem esse tipo de infecção.', 1253),
(417, 'Intestino', 'A hemorragia é a liberação do sangue do interior dos vasos que pode ser devido a um trauma, intoxicação química ou infecção biológica. A hiperplasia de enterócitos e necrose de coagulação das vilosidades intestinais ocorre devido a agressão contínua por um agente químico, físico ou biológico. No entanto, a visualização de cocos bacterianos e estruturas sugestivas de coccídeos sugere que as lesões foram causadas por bactérias e parasitas.', 1253),
(418, 'Estômago', 'Não foram observadas alterações histopatológicas dignas de nota.', 1253),
(419, 'Fígado', 'A congestão é o acúmulo de sangue nos vasos sanguíneos que pode ser devido a presença de agentes químicos, físicos ou biológicos. A necrose de coagulação de hepatócitos é a morte celular devido a agressão celular persistente de origem física, química ou biológica. A degeneração macrogoticular de hepatócitos pode ser devido a intoxicação química ou excesso de gordura na dieta.', 1253),
(420, 'Brânquias', 'A congestão e aneurismas é o acúmulo de sangue nos vasos sanguíneos que pode ser devido a presença de agentes químicos, físicos ou biológicos. A hiperplasia de células epiteliais, metaplasia e lise do epitélio branquial são uma resposta frente a agressão contínua de um agente químico, físico ou biológica. No entanto, a visualização de cocos bacterianos (inclusive nos aneurismas), Monogeneas e estruturas sugestivas de protozoários sugere que as lesões foram causadas por bactérias e parasitas.', 1253),
(421, 'Baço', 'A hemorragia é o extravasamento de sangue do interior do vaso sanguíneo que pode ser devido a trauma, intoxicação química ou infecção biológica. No entanto, a visualização de centros-melanomacrófagos indica infecção biológica, uma vez que essas células são recrutadas para inativar agentes patogênicos.', 1254),
(422, 'Estômago', 'A inflamação por linfócitos indica infecção biológica, uma vez que essas células são comuns para combater esse tipo de infecção.', 1254),
(423, 'Intestino', 'A necrose e lise das vilosidades intestinais são a morte celular e ruptura do epitélio que podem ser causada pela lesão persistente devido a agentes químicos, físicos ou biológicos. A presença de eosinófilos indica quadro alérgico ou infecção biológica. A cariólise de enterócitos indica apoptose, ou seja, morte celular que pode ser devido a agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos, estruturas sugestivas de coccídeos e de cistos de mixozoários sugere que as lesões foram causadas por bactérias e parasitas.', 1254),
(424, 'Brânquias', 'O aneurisma é o acúmulo de sangue que pode ser devido a agentes biológicos, físicos ou químicos. A hiperplasia de células epiteliais e metaplasia é a agressão contínua ao epitélio branquial que pode ser devido a agentes químicos, físicos ou biológicos. No entanto, a visualização de Monogenea e cisto de epiteliocystis sugere que as lesões foram causadas por bactérias e parasitas.', 1254),
(425, 'Brânquias', 'A congestão e aneurisma é o acúmulo de sangue nos vasos sanguíneos que pode ser devido a um trauma, intoxicação química ou infecção biológica. A hiperplasia de células epiteliais e metaplasia é uma resposta do aumento de células e mudança no epitélio devido a agressão contínua de agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos, cisto de epiteliocystis, cisto de protozoário e Monogenea sugere que as lesões foram causadas por bactérias e parasitas.', 1255),
(426, 'Fígado', 'A hemorragia intensa é o extravasamento de sangue dos vasos sanguíneos e a congestão é o acúmulo de sangue nos vasos sanguíneos que pode ser devido a um trauma, intoxicação química ou infecção biológica. No entanto, a visualização de cocos bacterianos sugere que as lesões vasculares foram causadas por bactérias. A degeneração macrogoticular de hepatócitos pode ser excesso de gordura na dieta ou intoxicação química.', 1255),
(427, 'Baço', 'A hemorragia intensa é o extravasamento de sangue dos vasos sanguíneos que pode ser devido a um trauma, intoxicação química ou infecção biológica. A visualização de centros-melanomacrófagos sugere infecção bioilógica, uma vez que essas células fazem fagocitose de agentes biológicos para sua inativação.', 1255),
(428, 'Estômago', 'A inflamação por linfócitos e eosinófilos indica infecção biológica, uma vez que essas células combatem esse tipo de infecção.', 1255),
(429, 'Intestino', 'A hemorragia é o extravasamento de sangue dos vasos sanguíneos que pode ser devido a um trauma, intoxicação química ou infecção biológica. A lise das vilosidades intestinais pode ter sido por um trauma, infecção biológica ou intoxicação química. A necrose de coagulação das vilosidades intestinais e cariólise de enterócitos indicam morte celular que pode ser devido a presença de agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos e estruturas sugestivas de mixozoários indicam que as lesões foram causadas por bactérias e parasitos.', 1255),
(430, 'Fígado', 'A hemorragia é o extravasamento de sangue do interior dos vasos sanguíneos que pode ser causada por um trauma, intoxicação química ou infecção biológica. A necrose de coagulação de hepatócitos é a morte celular das células hepáticas que pode ser devido a uma intoxicação química, trauma ou infecção biológica persistente. No entanto, a visualização de cocos bacterianos e estruturas sugestivas de protozoários demonstram que as lesões foram causadas por bactérias e parasitos.', 1256),
(431, 'Olho', 'Não foram observadas alterações histopatológicas dignas de nota.', 1256),
(432, 'Estômago', 'Embora não tenha sido observada lesão histopatológica, foram notados cocos bacterianos, trematóide no lúmen e estruturas sugestivas de mixosporídeos.', 1256),
(433, 'Brânquias', 'A hiperplasia de células epiteliais é o aumento do número de células epiteliais branquiais devido a agressão química, física ou biológica. No entanto, a visualização de estruturas sugestivas de protozoários, cocos bacterianos e Trichodina demonstram que as lesões foram causadas por bactérias e parasitas.', 1256),
(434, 'Intestino', 'A lise das vilosidades intestinais pode ter sido causada por um trauma, intoxicação química ou infecção biológica. A hiperplasia de enterócitos e necrose de coagulação das vilosidades intestinais são o aumento de células frente a agressão e morte celular pela persistência do agressor, seja químico, físico ou biológico. No entanto, a visualização de cocos bacterianos e estruturas sugestivas de protozoários sugerem que as lesões foram causadas por bactérias e parasitos.', 1256),
(435, 'Coração', 'A hiperplasia de miócitos é o aumento no número de células cardíacas que pode ser devido a agressão celular contínua por agentes químicos, físicos ou biológicos. No entanto, a visualização de estruturas sugestivas de mixozoários sugere que as lesões foram causadas por parasitas.  ', 1256),
(436, 'Cérebro', 'A inflamação por linfócitos é uma resposta do organismo para combater agentes biológicos. Fato reafirmado pela visualização de cocos bacterianos na meninge.', 1256),
(437, 'Músculo esquelético', 'Embora não tenha sido observada lesão histopatológica, foram notados cocos bacterianos.', 1256),
(438, 'Baço', 'A hemorragia é o extravasamento de sangue do interior dos vasos sanguíneos que pode ser causada por um trauma, intoxicação química ou infecção biológica. Por outro lado, a hiperplasia de polpa branca sugere infecção biológica, uma vez que os linfócitos são células recrutadas pelo sistema imune para combater agentes infecciosos.', 1256),
(439, 'Coração', 'A hemorragia é a lise dos vasos sanguíneo com extravasamento de sangue que pode ser por um trauma, intoxicação química ou infecção biológica.', 1278),
(440, 'Brânquias', 'A hiperplasia de células epiteliais e metaplasia é o aumento do número de células epiteliais e mudança no epitélio branquial que pode ser devido a agressão contínua por um agente químico, físico ou biológico. No entanto, a visualização de Trichodina, cocos bacterianos, Monogenea, estruturas sugestivas de protozoários e cisto sugestivo de epiteliocystis sugere que as lesões foram causadas por bactérias e parasitas.', 1278),
(441, 'Baço', 'A hiperplasia de polpa branca e centros-melanomacrófagos indica infecção biológica, uma vez que os linfócitos e macrófagos são células recrutadas para combater agentes biológicos.', 1278),
(442, 'Estômago', 'A necrose de coagulação é a morte celular devido a agressão contínua por agentes químicos, físicos ou biológicos. A visualização de eosinófilos sugere infecção biológica ou quadro alérgico.', 1278),
(443, 'Intestino', 'A hiperplasia de enterócitos é o aumento do número das células intestinais devido a agressão contínua por agentes biológicos, químicos ou físicos. A visualização de eosinófilos sugere infecção biológica ou quadro alérgico. No entanto, a visualização de estruturas sugestivas de coccídeos e cocos bacterianos sugere que as lesões foram causadas por bactérias e parasitas.', 1278),
(444, 'Fígado', 'A congestão é o acúmulo de sangue nos vasos sanguíneos que pode ser devido a um trauma, intoxicação química ou infecção biológica. No entanto, a visualização de cocos bacterianos sugere que a congestão foi causada por bactérias. ', 1278),
(445, 'Cérebro', 'Embora não tenha sido observada lesão histopatológica, foram notados cocos bacterianos na meninge.', 1279),
(446, 'Fígado', 'Embora não tenha sido observada lesão histopatológica, foram notadas estruturas sugestivas de mixozoários.', 1279),
(447, 'Brânquias', 'A hiperplasia de células epiteliais é o aumento do número de células epiteliais que pode ser devido a agressão contínua de agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos, inúmeros Monogeneas, Trichodina e cisto sugestivo de epiteliocystis sugere que as lesões são causadas por bactérias e parasitos.', 1279),
(448, 'Intestino', 'A lise das vilosidades intestinais pode ser causada por um trauma, infecção biológica ou intoxicação química. A presença de eosinófilos indica infecção biológica ou quadro alérgico. No entanto, a visualização de cocos bacterianos e estruturas sugestivas de protozoários indica que as lesões foram causadas por bactérias e parasitas.', 1279),
(449, 'Estômago', 'Não foram observadas alterações histopatológicas dignas de nota.', 1279),
(450, 'Fígado', 'A congestão é o acúmulo de sangue nos vasos sanguíneos que pode ser devido a agentes químicos, físicos ou biológicos. A hemorragia é a liberação de hemáceas dos vasos sanguíneos que pode ser devido a um trauma, intoxicação química ou infecção biológica. A presença de hemossiderina indica lise de hemáceas, uma vez que esse pigmento é formado quando há lise dessa célula. A degeneração macrogoticular de hepatócitos pode ser causada por intoxicação química ou excesso de gordura na dieta.', 1281),
(451, 'Baço', 'A hemorragia é a liberação de hemáceas dos vasos sanguíneos que pode ser devido a um trauma, intoxicação química ou infecção biológica. A presença de centros-melanomacrófagos indica infecção biológica, uma vez que os macrófagos são células que fagocitam patógenos.', 1281),
(452, 'Intestino', 'A lise das vilosidades intestinais pode ter sido causada por trauma, intoxicação química ou infecção biológica. No entanto, a visualização de cocos bacterianos sugere que a lesão foi ocasionada por bactérias.', 1281),
(453, 'Estômago', 'A congestão é o acúmulo de sangue nos vasos sanguíneos que pode ser devido a agentes químicos, físicos ou biológicos. ', 1281),
(454, 'Brânquias', 'A hiperplasia de células epiteliais e metaplasia é o aumento de células epiteliais e mudança no epitélio branquial que pode ser devido a agressão contínua celular e epitelial por agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos sugere que as lesões foram causadas por bactérias.', 1281),
(455, 'Brânquias', 'A congestão e aneurismas são o acúmulo de sangue nos vasos sanguíneos que pode ser devido a um trauma, infecção biológica ou intoxicação química. A hiperplasia de células epiteliais e metaplasia é o aumento de células epiteliais e alteração do epitélio branquial que é devido a agressão celular e tecidual contínua por agentes químicos, físicos ou biológicos. A lise do epitélio branquial pode ser devido a um trauma, agentes químicos ou biológicos. O edema braquial pode ser devido a agentes químicos, físicos ou biológicos. No entanto, a visualização de inúmeros monogeneas, Trichodina e cocos bacterianos sugere que as lesões foram causadas por bactérias e parasitas.', 1128),
(456, 'Intestino', 'A necrose de coagulação das vilosidades intestinais é a morte celular das células intestinais que pode ser devido a agressão contínua por agentes químicos, físicos ou biológicos. A inflamação por linfócitos e visualização de eosinófilos indicam infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater infecção biológica. A hiperplasia de enterócitos é o aumento do número de células intestinais que pode ser devido a agressão causada por agentes químicos, físicos ou biológicos. A hemorragia é o extravasamento de sangue dos vasos sanguíneos que pode ser devido a um trauma, intoxicação química ou infecção biológica. No entanto, a visualização de inúmeras estruturas sugestivas de mixosporídeos e cocos bacterianos sugere que as lesões foram causadas por bactérias e parasitas.', 1128),
(457, 'Estômago', 'A inflamação por linfócitos e eosinófilos sugerem infecção biológica, uma vez que essas células são recrutadas para combater esse tipo de infecção.', 1128),
(458, 'Fígado', 'A congestão é o acúmulo de sangue nos vasos sanguíneos que pode ser devido a um trauma, infecção biológica ou intoxicação química. No entanto, a visualização de cocos bacterianos sugere que a lesão foi causada por bactérias. A degeneração macrogoticular de hepatócitos indicam intoxicação química ou excesso de gordura na dieta.', 1128),
(459, 'Baço', 'A cariorrexe de linfócitos é a lise celular que indica morte celular que pode ser devido a agressão contínua por um agente químico, físico ou biológico. A hiperplasia de polpa branca e presença de centros-melanomacrófagos indicam infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater infecção biológica. Além disso, foram notados cocos bacterianos e estruturas sugestivas de mixosporídeos indicam que as lesões foram causadas por parasitos e bactérias.', 1129),
(460, 'Brânquias', 'A hiperplasia de células epiteliais e metaplasia é o aumento do número de células e alteração do epitélio branquial devido a agressão contínua por agentes químicos, físicos ou biológicos. A telangiectasia  é o acúmulo de sangue que pode ser devido a presença de agentes químicos, físicos ou biológicos. O edema branquial indica um início de um processo inflamatório que pode ser causado pela presença de agentes químicos, físicos ou biológicos. A presença de eosinófilos indicam um quadro alérgico ou infecção biológica. No entanto, a visualização de inúmero Monogeneas, inúmeras Trichodinas e cocos bacterianos indicam que as lesões foram causadas por bactérias e parasitas.', 1129),
(461, 'Rim', 'A inflamação por linfócitos e a presença de melanomacrófagos indicam infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater infecção. A hemorragia pode ter sido causada por um trauma, infecção biológica ou intoxicação química. A visualização de cocos bacterianos sugere que as lesões foram causadas por bactérias.', 1129),
(462, 'Coração', 'A inflamação por linfócitos indica infecção biológica, uma vez que essas células são recrutadas para combater infecção biológica. A hemorragia pode ter sido causada por um trauma, infecção biológica ou intoxicação química. A cariorrexe de linfócitos é a lise celular que indica morte celular que pode ser devido a agressão contínua por um agente químico, físico ou biológico.', 1129),
(463, 'Fígado', 'A congestão é a estase de sangue nos vasos sanguíneos que pode ser devido a intoxicação química, infecção biológica ou presença de agente físico. A necrose de coagulação de hepatócitos indica persistência de um agressor químico, físico ou biológico que levou a morte celular. A formação de granuloma é o isolamento de um patógeno, indicando também infecção biológica. Essa hipótese é reafirmada pela visualização de cocos bacterianos e estruturas sugestivas de mixosporídeos.', 1288),
(464, 'Brânquias', 'A hiperplasia de células epiteliais e metaplasia são o aumento do número de células e mudança no epitélio que pode ser devido a persistência de agentes químicos, físicos ou biológicos. No entanto, a visualização de Monogenea indica que as lesões foram causadas por parasitos.', 1288),
(465, 'Baço', 'Embora não tenha sido observada lesão, foram notados cocos bacterianos.', 1288),
(466, 'Intestino', 'A lise das vilosidades intestinais pode ser causada por um trauma ou infecção biológica. A necrose de coagulação de enterócitos indica persistência de um agressor químico, físico ou biológico que levou a morte celular. A hiperplasia de enterócitos é o aumento do número de células que pode ser devido a presença de agentes químicos, físicos ou biológicos. Essa hipótese é reafirmada pela presença de cocos bacterianos e estruturas sugestivas de microsporídeos, indicando que as lesões foram causadas por fungos e bactérias.', 1288),
(467, 'Rim', 'A inflamação por linfócitos indica presença de um agente biológico, uma vez que essas células combatem esse tipo de infecção. A presença de eosinófilos indica um quadro alérgico ou infecção biológica. A degeneração hidrópica dos túbulos renais pode ser devido a infecção biológica, intoxicação química ou presença de um agente físico. Essas hipóteses são reafirmadas pela presença de cocos bacterianos, indicando que as lesões foram causadas por bactérias.', 1288),
(468, 'Estômago', 'A lise do epitélio gástrico pode ser causada por um trauma ou infecção biológica. No entanto, a visualização de estruturas sugestivas de microsporídeos e cocos bacterianos sugerem que a lesão foi causada por fungos e bactérias.', 1288),
(469, 'Fígado', 'Os melanomacrófagos são células envolvidas para combater infecção biológica. Esse fato é reafirmado pela visualização de cocos, indicando que a lesão foi causada por bactérias.', 1306),
(470, 'Baço', 'A hemorragia é o extravasamento de sangue dos vasos sanguíneos que pode ser devido a um trauma, intoxicação química ou infecção biológica. No entanto, a visualização de centros-melanomacrófagos sugere infecção biológica, uma vez que essas células combatem esse tipo de infecção. ', 1306),
(471, 'Brânquias', 'A hiperplasia de células epiteliais e a metaplasia são o aumento do número de células epiteliais e alteração do epitélio branquial podem ser causadas pela persistência de um agressor químico, físico ou biológico. No entanto, a visualização de estruturas sugestivas de Monogenea indicam que as lesões foram causadas por parasitas.', 1306),
(472, 'Intestino', 'A lise das vilosidades intestinais pode ser causado por um trauma, intoxicação química ou infecção biológica. A necrose de coagulação das vilosidades intestinais é a morte de enterócitos que é devido a persistência de um agressor químico, físico ou biológico. No entanto, a visualização de estruturas nucleadas sugestivas de microsporídeos indicam que as lesões podem ser causadas por fungos.', 1306),
(473, 'Coração', 'A hiperplasia de miócitos é o aumento do número das células cardíacas devido a presença de um agressor químico, físico ou biológico.', 1306),
(474, 'Intestino', 'A lise das vilosidades intestinais pode ser causada por trauma, infecção biológica ou intoxicação química. A hiperplasia de enterócitos é o acúmulo do número de enterócitos que pode ser devido a agressão contínua por agentes químicas, físicas ou biológicas. A presença de eosinófilos e melanomacrófagos indicam infecção biológica, uma vez que essas células combatem infecção biológica. No entanto, a visualização de cocos bacterianos e estruturas sugestivas de microsporídeos indicam que as lesões foram causadas por bactérias e fungos.', 1332),
(475, 'Coração', 'Embora não tenha sido observada lesão, foram notadas inúmeras estruturas sugestivas de microsporídeos.', 1332),
(476, 'Fígado', 'A congestão é o acúmulo de sangue no interior dos vasos sanguíneos que pode ser devido a presença de agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos sugere que a lesão foi causada por bactérias.', 1332),
(477, 'Estômago', 'A lise do epitélio branquial pode ser causada por um trauma, intoxicação química ou infecção biológica. No entanto, a visualização de estruturas sugestivas de microsporídeos indica que a lesão foi causada por fungos.', 1332),
(478, 'Brânquias', 'A hiperplasia de células epiteliais e metaplasia é o aumento do número de células e alteração do epitélio que podem ser causadas pela persistência de agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos, Trichodina, Ichthyophthirius e Monogenea indicam que as lesões foram causadas por bactérias e parasitas.', 1332),
(479, 'Fígado', 'A congestão indica acúmulo de sangue no interior dos vasos sanguíneos que pode ser devido a um trauma, infecção biológica ou intoxicação química. A presença de melanomacrófagos indica infecção biológica, uma vez que essas células são recrutadas para combater esse tipo de infecção. Além disso, foram notados cocos bacterianos, reafirmando que as lesões foram causadas por bactérias.', 1333),
(480, 'Brânquias', 'A hiperplasia de células epiteliais, fusionamento lamelar e metaplasia são o aumento de número de células epiteliais, união entre os epitélios e alteração do epitélio é causado pela persistência de algum agressor, seja químico, físico ou biológico. No entanto, a visualização de cocos bacterianos e Trichodina indicam que as lesões foram causadas por bactérias e parasitas.', 1333),
(481, 'Intestino', 'A hiperplasia de enterócitos é o aumento de número dessas células indicam persistência de agressão química, física ou biológica. A necrose de coagulação das vilosidades intestinais é a morte célular de enterócitos que indica persistência na agressão química, física ou biológica. No entanto, a visualização de cocos bacterianos e estruturas sugestivas de microsporídeos indicam que as lesões foram causadas por bactérias e fungos.', 1333),
(482, 'Rim', 'A hemorragia é o extravasamento de sangue dos vasos sanguíneos que pode ser devido a um trauma, intoxicação química ou infecção biológica. No entanto, a visualização de cocos bacterianos e estruturas sugestivas de microsporídeos indica que a hemorragia foi causada por bactérias e fungos.', 1333),
(483, 'Baço', 'A hiperplasia de polpa branca é o aumento do número de linfócitos indica infecção biológica, uma vez que essas células combatem esse tipo de infecção. Além disso, foram notados cocos bacterianos, sugerindo que o aumento de linfócitos foi causado por infecção bacteriana.', 1333),
(484, 'Brânquias', 'A hiperplasia de células epiteliais e de Goblet e fusionamento do filamento branquial secundário é o aumento de número de células epiteliais e de Goblet e adesão entre os filamentos branquiais que são causados pela agressão persistente de agentes químicos, físicos ou biológicos. A presença de eosinófilos indica um quadro alérgico ou infecção biológica. A visualização de cocos bacterianos e estruturas sugestivas de ovos de Trichuris indicam que as lesões possam ter sido causadas por bactérias e parasitas. No entanto, a congestão intensa e inúmeros aneurismas, sendo que alguns impediram a circulação sanguínea normal podem ser causadas por agentes químicos, sendo muito associados a intoxicação por pesticidas. Devido a época de chuva pode ser a explicação da imensa resposta circulatória. As bactérias e parasitas presentes podem ser uma infecção secundária frente a agressão vascular ocasionada pelo agente químico. ', 1353),
(485, 'Rim', 'A hemorragia é o extravasamento de sangue do interior dos vasos pode ser ocasionado por um trauma, intoxicação química ou infecção biológica. A presença de melanomacrófagos indica infecção biológica, uma vez que essas células combatem esse tipo de infecção. A degeneração hidrópica tubular pode ter sido formada pela toxicidade química, infecção biológica ou trauma. A calcificação distrófica é a deposição de cálcio para isolamento de um agente biológico. A formação de granuloma indica infecção biológica, uma vez que o organismo tenta isolar o patógeno na formação de granuloma. Essas hipóteses são confirmadas pela visualização de cocos bacterianos.', 1354),
(486, 'Fígado', 'O infiltrado inflamatório constituído de linfócitos e eosinófilos indica infecção biológica, uma vez que a inflamação acompanhada de células de defesa indicam combate de agentes biológicos. A degeneração macrogoticular de hepatócitos pode ser causada por uma intoxicação química ou excesso de gordura na dieta.', 1354),
(487, 'Intestino', 'A lise das vilosidades intestinais pode ser devido a um trauma, intoxicação química ou infecção biológica. No entanto, a presença de estruturas sugestivas de esporos de fungos indicam que a lesão foi causada por fungos.', 1354),
(488, 'Baço', 'A hemorragia e a congestão é o extravasamento de sangue do interior dos vasos e acúmulo de sangue no interior dos vasos sanguíneos pode ser ocasionado por um trauma, intoxicação química ou infecção biológica. A hiperplasia de polpa branca e de melanomacrófagos é o aumento de linfócitos e melanomacrófagos, podendo ser causados por agentes biológicos, uma vez que essas células combatem esse tipo de infecção. Além disso, foram notados cocos bacterianos reafirmando que as lesões foram causadas por bactérias.', 1354),
(489, 'Estômago', 'O infiltrado inflamatório constituído de linfócitos e eosinófilos indica infecção biológica, uma vez que a inflamação acompanhada de células de defesa indicam combate de agentes biológicos.', 1354),
(490, 'Rim', 'A hemorragia é o extravasamento de sangue em decorrência da lise vascular que pode ser por um trauma, infecção biológica ou intoxicação química. A inflamação intensa por linfócitos acontece para combater um agente infeccioso que esteja causando lesão no organismo. Essa suspeita é reafirmada pela visualização de cocos bacterianos.', 1400),
(491, 'Cérebro', 'A inflamação intensa por linfócitos acontece para combater um agente infeccioso que esteja causando lesão no organismo. Essa suspeita é reafirmada pela visualização de cocos bacterianos.', 1400),
(492, 'Fígado', 'A congestão é o acúmulo de sangue no interior dos vasos sanguíneos que pode em decorrência de uma infecção biológica, intoxicação química ou trauma. A degeneração macrogoticular de hepatócitos indica intoxicação química ou excesso de gordura na dieta.', 1400),
(493, 'Músculo esquelético', 'Embora não tenha sido observado lesão, foram notados cocos bacterianos.', 1400),
(494, 'Brânquias', 'A lise do epitélio branquial pode ser causada por um trauma, infecção biológica ou intoxicação química.  A hiperplasia de células epiteliais é o aumento do número de células epiteliais que pode ser devido a agressão contínua de um agente químico, físico ou biológico. A hemorragia é o extravasamento de sangue em decorrência da lise vascular que pode ser por um trauma, infecção biológica ou intoxicação química. No entanto, a visualização de protozoários e cocos bacterianos sugerem que as lesões possam ter sido causadas por parasitos e bactérias.', 1400),
(495, 'Intestino', 'A necrose de coagulação das vilosidades intestinais é a morte de enterócitos que pode ser devido a agressão persistente biológica, química ou física. No entanto, a visualização de cocos bacterianos indica que a lesão foi causada por bactérias.', 1400),
(496, 'Olho', 'Não foi observada alteração histopatológica digna de nota.', 1400),
(497, 'Estômago', 'A inflamação por linfócitos ocorre para combater uma infecção biológica, fato esse confirmado pela visualização de cocos bacterianos e estruturas sugestivas de microsporídeos. ', 1379),
(498, 'Brânquias', 'A hiperplasia de células epiteliais, metaplasia e fusionamento do epitélio branquial são o aumento de células epiteliais, mudança do tipo de epitélio e fusão das lamelas secundárias acontecem pela agressão persistente de um agente químico, físico ou biológico. No entanto, a visualização de cocos bacterianos, Monogenea e Trichodina indicam que as lesões foram causadas por parasitas e bactérias.', 1379),
(499, 'Fígado', 'A congestão é o acúmulo de sangue no interior dos vasos sanguíneos que pode ser por um trauma, intoxicação química ou infecção biológica. No entanto, a visualização de cocos bacterianos sugere que a lesão foi causada por bactérias.', 1379),
(500, 'Intestino', 'A hiperplasia de células caliciformes é o aumento do número dessas células que produzem muco. Isso acontece para eliminar algum agente agressor às vilosidades intestinais. Essa hipótese é confirmada pela visualização de estruturas sugestivas de coccídeos, cocos bacterianos e estruturas sugestivas de microsporídeos.', 1379),
(501, 'Estômago', 'Não foram notadas alterações histopatológicas dignas de nota.', 1398),
(502, 'Brânquias', 'A hiperplasia de células epiteliais e metaplasia é o aumento do número de células e mudança no tipo de epitélio branquial que pode ser devido a agressão contínua química, física ou biológica. A congestão é o acúmulo de sangue no interior dos vasos que pode ser devido a um trauma, intoxicação química ou infecção biológica. No entanto, a visualização de cocos bacterianos e Monogenea indicam que as lesões foram causadas por parasitos e bactérias.', 1398),
(503, 'Intestino', 'A atrofia das vilosidades intestinais pode ocorrer por uma compressão dessa estrutura, seja por excesso de alimento ou algum agente físico. A necrose de coagulação da vilosidade intestinal é a morte celular que pode ser pela presença de agentes químicos, físicos ou biológicos persistentes no organismo.', 1398),
(504, 'Fígado', 'A congestão é o acúmulo de sangue no interior dos vasos que pode ser devido a um trauma, intoxicação química ou infecção biológica. A congestão é o acúmulo de sangue no interior dos vasos que pode ser devido a um trauma, intoxicação química ou infecção biológica. No entanto, a visualização de cocos bacterianos indica que as lesões foram causadas por bactérias.', 1398),
(505, 'Brânquias', 'A metaplasia e a hiperplasia de células epiteliais é a mudança do epitélio e aumento número de células epiteliais que pode ser devido a agressão contínua por agentes químicos, físicos ou biológicos. O aneurisma é a dilatação da artéria que pode ser devido a um agressor químico, físico ou biológico. No entanto, a presença de Monogenea e cisto sugestivo de epiteliocystis sugerem que as lesões foram causados por parasitas e bactérias.', 1399),
(506, 'Intestino', 'A atrofia das vilosidades intestinais pode ser devido a compressão do excesso de alimentos no lúmen ou agressão tecidual por um agente biológico ou químico.', 1399),
(507, 'Fígado', 'A congestão é o acúmulo de sangue que pode ser devido a presença de um agente químico, físico ou biológico.', 1399),
(508, 'Estômago', 'A lise do epitélio gástrica pode ser devido a um trauma ou perfuração por um agente biológico.', 1399),
(509, 'Intestino', 'A necrose de coagulação das vilosidades intestinais indicam morte dos enterócitos que pode ser devido a agressão biológica, química ou física. A presença de fibrina nas vilosidades intestinais indicam lise do endotélio ou cronicidade da lesão, o que enrijece a vilosidade intestinal, dificultando o funcionamento do órgão. A visualização de cocos bacterianos sugere que as lesões foram causadas por bactérias. ', 1380),
(510, 'Fígado', 'A degeneração macrogoticular de hepatócitos indica excesso de gordura na dieta ou intoxicação química. A hemorragia é o extravasamento de sangue dos vasos sanguíneos que pode ser por um trauma, intoxicação química ou infecção biológica. A inflamação por linfócitos indica infecção biológica, uma vez que essas células combatem agentes biológicos. No entanto, a visualização de cocos bacterianos indica que as lesões foram causadas por bactérias.', 1380),
(511, 'Estômago', 'Não foram observadas alterações histopatológicas dignas de nota.', 1380),
(512, 'Baço', 'A presença de centros-melanomacrófagos indica infecção, uma vez que essas células combatem agentes biológicos.', 1380),
(513, 'Rim', 'A hipertrofia das células epiteliais tubulares indica persistência na agressão biológica, física ou química. A hemorragia é o extravasamento de sangue dos vasos sanguíneos que pode ser por um trauma, intoxicação química ou infecção biológica. A inflamação por linfócitos indica infecção biológica, uma vez que essas células combatem agentes biológicos. No entanto, a visualização de cocos bacterianos indica que as lesões foram causadas por bactérias.', 1380),
(514, 'Brânquias', 'A hiperplasia de células epiteliais e metaplasia são o aumento do número de células epiteliais e mudança no epitélio que acontecem pela lesão persistente que pode ser devido a um agente biológico, químico ou físico. A visualização de monócitos indica infecção biológica, uma vez que essas células são do sistema imune para combater infecção. No entanto, a visualização de parasito ciliado e cocos bacterianos sugerem que as lesões foram causadas por bactérias e parasitos.', 1380),
(515, 'Estômago', 'Não foram observadas alterações histopatológicas.', 1381),
(516, 'Fígado', 'A congestão é o acúmulo de sangue no interior dos vasos que pode ser devido a intoxicação química, infecção biológica ou trauma. A presença de fibrina indica lise do endotélio ou cronicidade do processo.', 1381),
(517, 'Intestino', 'A hiperplasia de enterócitos e necrose de coagulação de enterócitos são o aumento do número de enterócitos e morte dessas células que pode ser devido a agressão persistente de um agente químico, físico ou biológico. A congestão é o acúmulo de sangue no interior dos vasos que pode ser devido a presença de agentes químicos, físicos ou biológicos. A hemossiderina indica lise de hemáceas, uma vez que esse pigmento é formado pela oxidação de ferro que é liberado na lise da hemácea, podendo ser causado por agentes químicos ou biológicos. A inflamação por linfócitos indica infecção biológica, uma vez que essas células combatem esse tipo de infecção. A presença de eosinófilos indica quadro alérgico ou infecção por fungos ou parasitas. No entanto, a visualização de cocos bacterianos, bacilos bacterianos e estruturas sugestivas de protozoários indicam que as lesões foram causadas por bactérias e parasitas.', 1381),
(518, 'Fígado', 'A congestão é o acúmulo de sangue no interior dos vasos que pode ser devido a intoxicação química, infecção biológica ou trauma. A presença de fibrina indica lise do endotélio ou cronicidade do processo.', 1381),
(519, 'Intestino', 'A hiperplasia de enterócitos e necrose de coagulação de enterócitos são o aumento do número de enterócitos e morte dessas células que pode ser devido a agressão persistente de um agente químico, físico ou biológico. A congestão é o acúmulo de sangue no interior dos vasos que pode ser devido a presença de agentes químicos, físicos ou biológicos. A hemossiderina indica lise de hemáceas, uma vez que esse pigmento é formado pela oxidação de ferro que é liberado na lise da hemácea, podendo ser causado por agentes químicos ou biológicos. A inflamação por linfócitos indica infecção biológica, uma vez que essas células combatem esse tipo de infecção. A presença de eosinófilos indica quadro alérgico ou infecção por fungos ou parasitas. No entanto, a visualização de cocos bacterianos, bacilos bacterianos e estruturas sugestivas de protozoários indicam que as lesões foram causadas por bactérias e parasitas.', 1381),
(520, 'Estômago', 'Não foram observadas alterações histopatológicas.', 1381),
(521, 'Brânquias', 'A hiperplasia de células epiteliais, fusionamento dos filamentos branquiais secundários e metaplasia são o aumento do número de células epiteliais,  fusão entre os epitélio lamelar e alteração do epitélio são causados pela persistência na agressão biológica, química ou física. No entanto, a visualização de Trichodina, Monogenea e cocos bacterianos sugere que as lesões foram causadas por bactérias e parasitas.', 1381),
(522, 'Brânquias', 'A hiperplasia de células epiteliais, fusionamento dos filamentos branquiais secundários e metaplasia são o aumento do número de células epiteliais,  fusão entre os epitélio lamelar e alteração do epitélio são causados pela persistência na agressão biológica, química ou física. No entanto, a visualização de Trichodina, Monogenea e cocos bacterianos sugere que as lesões foram causadas por bactérias e parasitas.', 1381),
(523, 'Brânquias', 'A hiperplasia de células epiteliais, metaplasia e fusionamento dos filamentos branquiais secundários são o aumento do número de células epiteliais, mudança no epitélio branquial e fusão do filamento branquial são causados pela agressão persistente por agentes químicos, físicos ou biológicos. No entanto, a visualização de Trichodina, Monogenea e cocos bacterianos sugere que as lesões foram causadas por parasitas e bactérias.', 1382),
(524, 'Intestino', 'A lise das vilosidades intestinais pode ser causada por um trauma, infecção biológica ou intoxicação química. A necrose de coagulação das vilosidades intestinais é a morte de enterócitos que pode ser devido a agressão contínua por agentes químicos, físicos ou biológicos. A presença de eosinófilos sugere um quadro alérgico ou infecção biológica. No entanto, a visualização de cocos bacterianos e estruturas sugestivas de coccídeos sugere que as lesões foram causadas por bactérias e parasitos.', 1382),
(525, 'Fígado', 'A degeneração macrogoticular de hepatócitos indica excesso de gordura na dieta ou intoxicação química. A congestão é o acúmulo de sangue no interior dos vasos que pode ser devido a agressão biológica, química ou física. A presença de cocos bacterianos sugere que as bactérias estão causando a congestão observada. ', 1382),
(526, 'Baço', 'A hemorragia é o extravasamento de sangue do interior dos vasos sanguíneos que pode ser devido a um trauma, infecção biológica ou intoxicação química. A hiperplasia de centros-melanomacrófagos indica infecção biológica, uma vez que essas células estão envolvidas no combate desse tipo de infecção.', 1382),
(527, 'Sistema Nervoso Central', 'A inflamação por linfócitos indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater infecção biológica. ', 1382),
(528, 'Intestino', 'A hemorragia é a liberação de sangue do interior dos vasos sanguíneos que pode ser devido a um trauma, intoxicação química ou infecção biológica. A inflamação por linfócitos e melanomacrófagos indicam infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater infecção. A lise das vilosidades intestinais e necrose das vilosidades intestinais são a perda da integridade das vilosidades intestinais e morte de enterócitos que pode ser devido a agressão contínua por agentes físicos, químicos ou biológicos. A presença de hemossiderina indica lise de hemáceas, pois é formada pela oxidação do ferro liberado quando essa célula é lisada. A presença de estruturas sugestivas de Megalocytivírus e mixosporídeos demonstram que as lesões possam ter sido causadas por vírus e parasitas.', 1401),
(529, 'Brânquias', 'A hiperplasia de células epiteliais é o aumento do número dessas células que pode ser devido a agressão celular por agentes químicos, físicos ou biológicos. O edema do filamento branquial é a presença de líquido que saiu do vaso sanguíneo, um resultado de inflamação que pode ser por agentes químicos, físicos ou biológicos. Os aneurismas é a dilatação dos vasos sanguíneos que pode ser devido a presença de agentes físicos, químicos ou biológicos. A formação de granuloma contendo estruturas sugestivas de mixosporídeos sugere que as lesões possam ter sido causadas por parasitas. ', 1401),
(530, 'Fígado', 'A degeneração macrogoticular de hepatócitos indica intoxicação química ou excesso de gordura na dieta. A congestão é o acúmulo de sangue no interior dos vasos que pode ser por um trauma, infecção biológica ou intoxicação química. A inflamação por linfócitos e melanomacrófagos indicam infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater infecção. A presença de eosinófilos sugere quadro alérgico ou infecção biológica por parasitas ou fungos.', 1401),
(531, 'Rim', 'A congestão é o acúmulo de sangue no interior dos vasos que pode ser por um trauma, infecção biológica ou intoxicação química. A inflamação por linfócitos e melanomacrófagos indicam infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater infecção. A presença de eosinófilos sugere quadro alérgico ou infecção biológica por parasitas ou fungos. A hemorragia é a liberação de sangue do interior dos vasos sanguíneos que pode ser devido a um trauma, intoxicação química ou infecção biológica. A presença de fibrina é liberada devido a lise vascular.', 1401),
(532, 'Fígado', 'A degeneração macrogoticular de hepatócitos é causada pela intoxicação química ou excesso de gordura na dieta. A inflamação por linfócitos e eosinófilos  indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção. A congestão e formação de trombos é a presença de hemáceas no vaso sanguíneo e trombos são formados quando há lise do endotélio vascular, ambos por agressão física, química ou biológica. A presença de hialina indica irritação contínua ao órgão, seja de origem física, química ou biológica. A formação de granulomas é um mecanismo do sistema imune para isolar um agente biológico, seja bactéria, parasita ou fungos. No entanto, a visualização de cocos bacterianos sugerem que as lesões foram causadas por bactérias.', 1402),
(533, 'Rim', 'A inflamação por linfócitos indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater agentes  infecciosos. A degeneração hidrópica dos túbulos renais acontece pela agressão contínua de agentes químicos, físicos ou biológicos. A hemorragia é o extravasamento de sangue do interior dos vasos sanguíneos que pode ser devido a um trauma, intoxicação química ou infecção biológica. A formação de granulomas acontece para isolar um agente biológico, podendo ser bactérias, parasitas ou fungos. No entanto, a visualização de cocos bacterianos sugere que as lesões foram causadas por bactérias.', 1402),
(534, 'Brânquias', 'A telangiectasia é a dilatação de pequenos vasos sanguíneos que pode ser devido a agressão contínua por agentes físicos, químicos ou biológicos. A hiperplasia de células epiteliais e fusionamento dos filamentos branquiais é o aumento do número de células epiteliais e fusão das lamelas secundárias pode ser devido a agressão persistente de agentes biológicos, químicos ou físicos. O edema do filamento branquial é um sinal de início de um processo inflamatório que pode ser causado por agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos e Monogenea, indicando que as lesões foram causadas por bactérias e parasitas.', 1402),
(535, 'Musculatura esquelética', 'A hiperplasia de miócitos é o aumento do número dessas células que pode ser devido a agressão contínua por agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos sugere que a hiperplasia foi causada por bactérias.', 1408),
(536, 'Brânquias', 'A hiperplasia de células epiteliais e fusionamento dos filamentos branquiais secundários são o aumento de número de células epiteliais e fusão lamelar são causados pela agressão contínua por agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos sugere que as lesões foram causadas por bactérias.', 1408),
(537, 'Olho', 'Não foram observadas alterações histopatológicas.', 1408),
(538, 'Rim', 'A hemorragia é o extravasamento de sangue dos vasos sanguíneos que pode ser devido a um trauma, intoxicação química ou infecção biológica. A inflamação por linfócitos indica infecção, uma vez que essas células são recrutadas pelo sistema imune para combater infecção biológica. Além disso, foram notados cocos bacterianos reafirmando que a inflamação foi causada por bactérias.', 1408),
(539, 'Estômago', 'Embora não tenha sido observada lesão, foram notadas estruturas sugestivas de Cryptosporidium.', 1408),
(540, 'Fígado', 'A degeneração macrogoticular de hepatócitos indica excesso de gordura na dieta ou intoxicação química. A congestão é o acúmulo de sangue nos vasos sanguíneos pode ser devido a um trauma, intoxicação química ou infecção biológica. A necrose de coagulação é a morte celular dos hepatócitos que pode ser devido a agressão contínua de agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos sugere que as lesões foram causadas por bactérias.', 1408),
(541, 'Cérebro', 'A inflamação por linfócitos indica infecção, uma vez que essas células são recrutadas pelo sistema imune para combater infecção biológica. Além disso, foram notados cocos bacterianos reafirmando que a inflamação foi causada por bactérias.', 1408),
(542, 'Intestino', 'A necrose de coagulação das vilosidades intestinais é a morte de enterócitos que pode ser causada pela agressão contínua de agentes químicos, físicos ou biológicos. No entanto, a visualização de estruturas nucleadas sugestivas de microsporídeos sugere que a morte celular foi causada por fungos.', 1408),
(543, 'Ovários', 'Não foram observadas alterações histopatológicas dignas de nota.', 1448),
(544, 'Estômago', 'Não foram observadas alterações histopatológicas dignas de nota.', 1448),
(545, 'Bexiga natatória', 'Não foram observadas alterações histopatológicas dignas de nota.', 1448),
(546, 'Brânquias', 'A hiperplasia de células epiteliais e metaplasia do epitélio branquial indica aumento do número de células e mudança no epitélio que podem acontecer devido a agressão contínua de agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos e Monogenea indicam que as lesões possam ter sido causadas por bactérias e parasitos.', 1448),
(547, 'Olho', 'Não foram observadas alterações histopatológicas dignas de nota.', 1448),
(548, 'Intestino', 'A necrose de coagulação das vilosidades intestinais é a morte celular de enterócitos que pode ser devido a agressividade contínua de agentes químicos, físicos ou biológicos. A inflamação por linfócitos indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção. Além disso, foram notados cocos bacterianos, reafirmando que a inflamação foi desencadeada pela bacteriose. ', 1448),
(549, 'Cérebro', 'A inflamação por linfócitos indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção. Além disso, foram notados cocos bacterianos, reafirmando que a inflamação foi desencadeada pela bacteriose. ', 1448),
(550, 'Baço', 'A hiperplasia de polpa branca acentuada é o aumento do número de linfócitos que indica uma infecção biológica, uma vez que essas células estão envolvidas no combate desse tipo de infecção.', 1448),
(551, 'Fígado', 'A degeneração macrogoticular de hepatócitos pode ser causada pelo excesso de gordura na dieta ou intoxicação química. Também foram notados cocos bacterianos.', 1448),
(552, 'Músculo esquelético', 'Embora não tenha sido observada lesão, foram notados cocos bacterianos em grande quantidade.', 1448),
(553, 'Rim', 'A inflamação por linfócitos indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção. A degeneração hidrópica dos túbulos renais é causado pela agressão contínua por agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos sugere que as lesões possam ter sido causadas por bactérias.', 1448),
(554, 'Baço', 'Não foram observadas alterações histopatológicas dignas de nota.', 1459),
(555, 'Estômago', 'Não foram observadas alterações histopatológicas dignas de nota.', 1459),
(556, 'Fígado', 'A degeneração macrogoticular de hepatócitos indica intoxicação química ou excesso de gordura na dieta. A presença de fibrina lesão vascular, uma vez que essa proteína é produzida para reparar lise do endotélio.', 1459),
(557, 'Coração', 'A congestão é o acúmulo de sangue nos vasos sanguíneos que pode ser devido a intoxicação química, trauma ou infecção biológica. A hiperplasia de miócitos indica agressão contínua no miocárdio por agentes químicos, físicos ou biológicos.', 1459),
(558, 'Brânquias', 'A hiperplasia de células epiteliais e metaplasia indicam que há agressão persistente por agentes químicos, físicos ou biológicos causando o aumento do número das células epiteliais ou mudança no epitélio. A lise do epitélio branquial pode ter sido causado por trauma, intoxicação química ou infecção biológica. A presença de aneurismas pode ser causado por intoxicação química ou infecção biológica.', 1459),
(559, 'Músculo esquelético', 'A presença de eosinófilos indica parasitismo, infecção fúngica, bacteriana ou alergia. No entanto, a visualização de cocos bacterianos indica que os eosinófilos foram recrutados pela infecção bacteriana.', 1459),
(560, 'Bexiga natatória', 'A moderada população de eosinófilos indica alergia ou infecção biológica por parasitas, fungos ou bactérias. No entanto, a visualização de cocos bacterianos sugere que os eosinófilos foram recrutadas por uma infecção biológica.', 1459),
(561, 'Intestino', 'A lise das vilosidades intestinais pode ser causada por um trauma ou intoxicação química. A hiperplasia de enterócitos pode ser causada pela agressão contínua de agentes químicos, físicos ou biológicos. No entanto, a visualização de estruturas sugestivas de microsporídeos e cocos bacterianos sugerem que as lesões foram causadas por bactérias e fungos.', 1459),
(562, 'Coração', 'A hiperplasia de miócitos é o aumento do número dessas células que pode ser devido a agressão contínua por agentes químicos, físicos ou biológicos.', 1460),
(563, 'Fígado', 'A degeneração macrogoticular de hepatócitos indica intoxicação química ou excesso de gordura na dieta. A inflamação discreta por linfócitos indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater infecção biológica.', 1460),
(564, 'Brânquias', 'A hiperplasia das células epiteliais é o aumento do número dessas células que pode ser devido a agressão contínua de agentes químicos, físicos ou biológicos. A descamação do epitélio branquial pode ser devido a um trauma, infecção biológica ou intoxicação química. Os aneurismas podem ser devido a agressão biológica, química ou física persistente. No entanto, a visualização de estruturas sugestivas de mixosporídeos sugere que as lesões possam ter sido causada por parasitas.', 1460),
(565, 'Intestino', 'A lise das vilosidades intestinais pode ser devido a um trauma, infecção biológica ou intoxicação química. A hiperplasia de enterócitos é o aumento de número de células que pode ser devido a agressão contínua de agentes químicos, físicos ou biológicos. No entanto, a presença de estruturas sugestivas de microsporídeos sugere que as lesões foram causadas por fungos.', 1460),
(566, 'Baço', 'Não foram observadas alterações histopatológicas dignas de nota.', 1460),
(567, 'Intestino', 'A lise das vilosidades intestinais pode ser devido a um trauma, infecção biológica ou intoxicação química. A necrose de coagulação das vilosidades intestinais é a morte de células intestinais que pode ser devido a agressão contínua por agentes químicos, físicos ou biológicos. No entanto a visualização de estruturas circulares basofílicas sugestivas de protozoários indicam que as lesões foram causadas por parasitas.', 1515),
(568, 'Estômago', 'A inflamação por linfócitos indica infecção biológica, uma vez que essas células são recrutadas para combater infecção biológica.', 1515),
(569, 'Baço', 'A hemorragia é causada pela lesão dos vasos sanguíneos que pode ser devido a um trauma, infecção biológica ou intoxicação química. A presença de centros-melanomacrófagos indica infecção biológica, uma vez que essas células são recrutadas para combater infecção biológica.', 1515),
(570, 'Fígado', 'A degeneração macrogoticular de hepatócitos pode ser devido a intoxicação química ou excesso de gordura na dieta. A congestão moderada é o acúmulo de sangue nos vasos sanguíneos que pode ser devido a intoxicação química, infecção biológica ou trauma. A inflamação por linfócitos e eosinófilos  indica infecção biológica, uma vez que essas células são recrutadas para combater infecção biológica. Também foram notados pigmentos de melanina que indicam degradação de hemáceas que pode ser devido a intoxicação química ou infecção biológica.', 1515),
(571, 'Brânquias', 'A hiperplasia de células epiteliais, fusionamento lamelar e metaplasia são o aumento do número de células epiteliais, junção do epitélio branquial e mudança do epitélio branquial pode ser causado pela agressão contínua por agentes químicos, físicos ou biológicos. A telangiectasia é a dilatação de pequenos vasos que pode ser devido a intoxicação química, infecção biológica ou trauma. No entanto, a visualização de estruturas sugestivas de protozoários, cocos bacterianos e Trichodina indicam que as lesões foram causadas por parasitas e bactérias.', 1515),
(572, 'Baço', 'A hemorragia pode ser devido a um trauma, infecção biológica ou intoxicação química. A presença de centros-melanomacrófagos indica infecção biológica, uma vez que essas células auxiliam no combate aos patógenos.', 1516),
(573, 'Intestino', 'A hiperplasia de enterócitos é o aumento de número das células intestinais que pode ser devido a agressão biológica, química ou física. A inflamação por linfócitos e eosinófilos  indica infecção biológica, uma vez que essas células auxiliam no combate aos patógenos. A visualização de estruturas sugestivas de coccídeos sugerem que as lesões possam ter sido causadas por parasitos.', 1516),
(574, 'Fígado', 'A degeneração macrogoticular de hepatócitos indica excesso de gordura na dieta ou intoxicação química. A congestão é o acúmulo de sangue nos vasos sanguíneos que pode ser devido a um agressor químico, físico ou biológico. A inflamação por linfócitos e eosinófilos indica infecção biológica, uma vez que essas células auxiliam no combate aos patógenos.', 1516),
(575, 'Coração', 'A hemorragia pode ser devido a um trauma, infecção biológica ou intoxicação química. A degeneração vacuolar do miocárdio pode ser devido a presença de agressores químicos, físicos ou bioilógicos. A inflamação por linfócitos indica infecção biológica, uma vez que essas células auxiliam no combate aos patógenos.', 1516),
(576, 'Rim', 'A calcificação do lúmen tubular indica excesso de minerais do ambiente ou da ração. A degeneração hidrópica tubular pode ser devido a agressão biológica, física ou química. A inflamação por linfócitos e presença de melanomacrófagos indicam infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção. A hemorragia pode ter sido causado por trauma, infecção biológica ou intoxicação química. A formação de granulomas indica presença de bactéria, fungos ou parasitas, pois é o mecanismo que o organismo usa para isolar esses patógenos e proteger o hospedeiro.', 1516),
(577, 'Brânquias', 'A hiperplasia de células epiteliais e fusionamento lamelar são o aumento do número de células epiteliais e junção do epitélio branquial que podem ser em decorrência da agressão contínua por agentes químicos, físicos ou biológicos. A visualização de eosinófilos indica quadro alérgico ou infecção biológica.', 1516),
(578, 'Bexiga natatória', 'A hemorragia pode ser causada por um trauma, infecção biológica ou intoxicação química. A inflamação por linfócitos indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção. A presença de eosinófilos indica quadro alérgico ou infecção biológica.', 1517),
(579, 'Intestino', 'A lise das vilosidades intestinais pode ser devido a um trauma, infecção biológica ou intoxicação química. O aumento da produção de muco é um mecanismo para expulsar um agente nocivo ao organismo, podendo ser de origem química, física ou biológica. A inflamação por linfócitos e eosnófilos indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção.', 1517),
(580, 'Baço', 'A hemorragia pode ser causada por um trauma, infecção biológica ou intoxicação química. A presença de centros-melanomacrófagos indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção.', 1517),
(581, 'Fígado', 'A degeneração macrogoticular de hepatócitos indica excesso de gordura na dieta ou intoxicação química. A congestão é o acúmulo de sangue no interior dos vasos sanguíneos que pode ser devido a agressão biológica, química ou física. A inflamação por linfócitos e eosinófilos indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção.', 1517),
(582, 'Estômago', 'A inflamação por linfócitos e eosinófilos indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção. A presença de estruturas sugestivas de mixosporídeos sugerem que a inflamação pode ser em decorrência do parasitismo.', 1517),
(583, 'Brânquias', 'A hiperplasia de células epiteliais e fusionamento lamelar são o aumento do número de células epiteliais e fusionamento do epitélio branquial que pode ser devido a agressão contínua de agentes químicos, físicos ou biológicos. A presença de inúmeros aneurismas (dilatação dos vasos repletos de sangue) e congestão (vasos sanguíneos repletos de sangue) pode ser pela presença de agressor químico, físico ou biológico. O edema do filamento branquial é uma resposta da inflamação (não observada no tecido coletado) ou excesso de proteína no sangue. A visualização de Monogenea sugere que as lesões foram causadas por parasitas.', 1517),
(584, 'Fígado', 'A degeneração macrogoticular de hepatócitos pode ser devido a intoxicação química ou excesso de gordura na dieta. A necrose dos hepatócitos é a morte dessas células que pode ser devido a agressão contínua de agentes químicos, físicos ou biológicos. ', 1572),
(585, 'Intestino', 'A lise das vilosidades intestinais pode ser em decorrências de um trauma, infecção biológica ou intoxicação química. A necrose de coagulação dos enterócitos é a morte dessas células que pode ser devido a agressão contínua de agentes biológicos, químicos ou físicos. A inflamação por linfócitos e presença de eosinófilos sugere infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção.', 1572),
(586, 'Brânquias', 'A hiperplasia de células epiteliais, fusionamento lamelar e metaplasia são o aumento de número de células epiteliais, fusão do epitélio lamelar e mudança do epitélio branquial podem ser causados pela agressão contínua de agentes químicos, físicos ou biológicos. A congestão é o acúmulo de sangue nos vasos sanguíneos que pode ser por trauma, intoxicação química ou infecção biológica. No entanto, a visualização de Trichodina, Monogenea, Ichthyophthirius multifilis e formação de granuloma contendo estruturas sugestivas de esporos de Branchiomyces sugere que as lesões foram causadas por fungos e parasitas.', 1572),
(587, 'Fígado', 'A cariorrexe de hepatócitos é a lise nuclear ocasionada pela morte celular que pode ser devido a agressão biológica, química ou física. A congestão é o acúmulo de sangue nos vasos que pode ser causado por um trauma, intoxicação química ou infecção biológica. O pigmento de melanina no fígado é normal em pequena quantidade, conforme observado na amostra analisada.', 1573),
(588, 'Rim', 'A inflamação por linfócitos sugere infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção. A hemorragia intensa pode ser devido a um trauma, infecção biológica ou intoxicação química. A degeneração hidrópica e hialina tubular podem ser causadas pela agressão biológica, química ou física. No entanto, a presença de cocos bacterianos sugere que as lesões foram causadas por bactérias.', 1573),
(589, 'Intestino', 'A lise das vilosidades intestinais pode ter sido causada por trauma, infecção biológica ou intoxicação química. A necrose de coagulação das vilosidades intestinais é a morte dos enterócitos que pode ser devido a agressão contínua por agentes químicos, físicos ou biológicos. A presença de eosinófilos sugere alergia ou infecção biológica. No entanto, a presença de cocos bacterianos sugere que as lesões foram causadas por bactérias.', 1573),
(590, 'Brânquias', 'A hiperplasia de células epiteliais é o aumento do número dessas células que pode ser devido a agressão contínua biológica, química ou física. No entanto, a presença de Trichodina, Monogenea e granulomas contendo estruturas sugestivas de Branchiomyces sugere que as lesões foram causadas por fungos e parasitas.', 1573),
(591, 'Estômago', 'A inflamação por linfócitos e eosinófilos sugere infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção.', 1573),
(592, 'Baço', 'A hiperplasia de polpa branca e de centros-melanomacrófagos sugere um quadro infeccioso, uma vez que essas células são produzidas (linfócitos e macrófagos) para combate de agentes biológicos.', 1654),
(593, 'Intestino', 'A hiperplasia de células caliciformes é o aumento na quantidade dessas células que pode ser um mecanismo para expulsar algum agressor, seja ele químico, físico ou biológico, uma vez que essas células são responsáveis pela produção de muco. A lise das vilosidades intestinais pode ser causada pela agressão química, física ou biológica. A presença de eosinófilos sugere um quadro alérgico ou infeccioso, principalmente por parasitas. Essa hipótese é reafirmada pela observação de estruturas sugestivas de coccídeos, que podem ser o agente causador das lesões observadas.', 1654),
(594, 'Brânquias', 'O fusionamento lamelar e hiperplasia de células epiteliais são a junção do epitélio lamelar e aumento do número de células epiteliais que acontecem devido a agressão contínua de agentes químicos, físicos ou biológicos. A telangiectasia é a dilatação dos vasos sanguíneos que pode ser devido a agressão química, física ou biológica. A necrose de coagulação é a morte celular com preservação da estrutura tecidual, podendo ser ocasionada pela agressão química, física ou biológica persistente. No entanto, a presença de estruturas sugestivas de Branchiomyces, Monogenea e Trichodina sugerem que as lesões foram causadas por parasitas e fungos.', 1654),
(595, 'Fígado', 'Não foram observadas alterações histopatológicas dignas de nota.', 1654),
(596, 'Cérebro', 'A inflamação por linfócitos indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater infecção biológica. Essa hipótese é reafirmada pela visualização de cocos bacterianos.', 1658),
(597, 'Fígado', 'A degeneração microgoticular de hepatócitos indica excesso de gordura na dieta ou intoxicação química.', 1658),
(598, 'Brânquias', 'A hiperplasia de células epiteliais e fusionamento dos filamentos branquiais secundários são o aumento do número de células epiteliais e aderência entre os filamentos branquiais que pode ser devido a agressão persistente de origem química, física ou biológica. No entanto, a visualização de cocos bacterianos sugere que as lesões foram causadas por bactérias. ', 1658),
(599, 'Bexiga natatória', 'Não foi observada alteração histopatologia digna de nota.', 1658),
(600, 'Rim', 'A inflamação por linfócitos indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater infecção biológica. A degeneração hidrópica tubular renal pode ser causada pela agressão química, física ou biológica. A hemorragia é causada pela lise vascular que pode ser devido a um trauma, intoxicação química ou infecção biológica. Entretanto, a presença de cocos bacterianos sugere que as lesões foram causadas por bactérias.', 1658),
(601, 'Intestino', 'A necrose de coagulação das vilosidades intestinais é a morte celular com preservação do tecido, podendo ser causada pela agressão contínua de agentes químicos, físicos ou biológicos. No entanto, a visualização de estruturas sugestivas de coccídeos nas vilosidades intestinais sugere que as lesões foram causadas por parasitos.', 1658),
(602, 'Olho', 'Não foi observada alteração histopatologia digna de nota.', 1658),
(603, 'Músculo esquelético', 'A hiperplasia de miócitos é o aumento do número dessas células que pode ser pela presença de um agressor químico, físico ou biológico. No entanto, a visualização de cocos bacterianos sugere que a hiperplasia está sendo causada pela infecção bacteriana.', 1658),
(604, 'Músculo esquelético', 'A hiperplasia de miócitos é o aumento do número das células musculares que pode ser devido a agressão contínua de origem química, física ou biológica. No entanto, a visualização de cocos bacterianos sugere que a hiperplasia foi causada por bactérias.', 1659),
(605, 'Cérebro', 'A inflamação por linfócitos sugere uma infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção. A vacuolização da microglia pode ser em resposta um quadro de intoxicação química, agentes virais ou parasitários.', 1659),
(606, 'Olho', 'Não foram observadas alterações histopatológicas dignas de nota.', 1659),
(607, 'Fígado', 'A degeneração macrogoticular de hepatócitos indica excesso de gordura na dieta ou intoxicação química.', 1659),
(608, 'Intestino', 'A hiperplasia de enterócitos é o aumento no número dessas células que pode ser em decorrência de infecção biológica, intoxicação química ou trauma. A lise das vilosidades intestinais pode ser causada por um trauma, intoxicação química ou infecção biológica. A necrose e erosão das vilosidades intestinais podem ser causadas por agentes químicos, físicos ou biológicos. No entanto, a observação de estruturas sugestivas de coccídeos indicam que as lesões foram causadas por parasitas.', 1659),
(609, 'Brânquias', 'A metaplasia é a mudança do epitélio branquial que pode ser devido a agressão contínua de agentes químicos, físicos ou biológicos. A presença de eosinófilos indica agentes biológicos infecciosos ou um quadro de alergia. No entanto, a visualização de cocos bacterianos sugere que as lesões foram causadas por bactérias.', 1659),
(610, 'Estômago', 'A lise do epitélio gástrico pode ter sido causado por um trauma, intoxicação química ou infecção biológica. A necrose de coagulação da camada glandular é a morte dessas células em decorrência de uma infecção biológica, intoxicação química ou trauma persistente.', 1659),
(611, 'Rim', 'A inflamação por linfócitos sugere uma infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção. A degeneração hidrópica tubular pode ser em resposta a agressão contínua de agentes químicos, físicos ou biológicos. A hemorragia pode ser causada por um trauma, intoxicação química ou infecção biológica. No entanto, a observação de cocos bacterianos sugere que as lesões foram causadas por bactérias.', 1659),
(612, 'Brânquias', 'A hiperplasia de células epiteliais e de Goblet e fusionamento lamelar são o aumento do número de células epiteliais e de Goblet e fusionamento dos filamentos branquiais secundários que pode ser devido a agressão contínua por agentes químicos, físicos ou biológicos. A inflamação por linfócitos indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção. A congestão e telangiectasia são a estase de sangue que pode ser devido a intoxicação química, trauma, neoplasias ou infecção biológica. A lise do epitélio branquial pode ter sido por um trauma, infecção biológica ou intoxicação química. No entanto, a visualização de estruturas sugestivas de mixosporídeos, Monogeneas e cocos bacterianos sugere que as lesões foram causadas por bactérias e parasitas.', 1660),
(613, 'Fígado', 'A degeneração macrogoticular de hepatócitos indica excesso de gordura na dieta ou intoxicação química.', 1660),
(614, 'Intestino', 'A lise das vilosidades intestinais pode ser um trauma, intoxicação química ou infecção biológica. A inflamação por linfócitos indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção. ', 1660),
(615, 'Estômago', 'A inflamação por linfócitos e eosinófilos indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção. ', 1660),
(616, 'Baço', 'Não foram observadas alterações histopatológicas dignas de nota.', 1660),
(617, 'Estômago', 'A necrose de coagulação indica a persistência da agressão de um agente químico, físico ou biológico.', 1702),
(618, 'Fígado', 'A degeneração microgoticular dos hepatócitos indica intoxicação química ou excesso de gordura na dieta. A hemossiderina é um pigmento formado pela oxidação da porção heme devido a lise de hemácias que pode ser devido a presença de agentes químicos, físicos ou biológicos. A congestão é o acúmulo de sangue nos vasos que pode ser devido a presença de agentes químicos, físicos ou biológicos.  A necrose de coagulação dos hepatócitos é a morte das células citadas pela irritação constante de agentes químicos, físicos ou biológicos. ', 1702),
(619, 'Brânquias', 'A hiperplasia de células epiteliais e fusionamento lamelar é o aumento do número de células e fusão do epitélio branquial que podem ser devido a infecção biológica, física ou química persistente.', 1702),
(620, 'Intestino', 'A lise das vilosidades intestinais e necrose de coagulação podem ser provocadas por trauma, intoxicação química e infecção biológica persistente. A inflamação por linfócitos indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção.  A hemossiderina é um pigmento formado pela oxidação da porção heme devido a lise de hemácias que pode ser devido a presença de agentes químicos, físicos ou biológicos. No entanto, a visualização de estruturas sugestivas de megalocytivírus sugere que as lesões foram causados por vírus.', 1702),
(621, 'Brânquias', 'A hiperplasia de células epiteliais, metaplasia e fusionamento lamelar são o aumento do número de células epiteliais, mudança no epitélio branquial e fusão das lamelas que pode ser devido a agressão contínua de agentes químicos, físicos ou biológicos. No entanto, a visualização de estruturas sugestivas de Trichodina sugerem que as lesões foram causadas por parasitas.', 1703),
(622, 'Fígado', 'A degeneração macrogoticular de hepatócitos indica excesso de gordura na dieta ou intoxicação química. A congestão é o acúmulo de sangue nos vasos sanguíneos que pode ser por um trauma, infecção biológica ou intoxicação química. A hemossiderina é formada pela oxidação da porção heme da hemácia liberada após a sua lise, que pode ser em decorrência de infecção biológica, química ou física. A inflamação por linfócitos sugere infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção.', 1703),
(623, 'Intestino', 'A lise e necrose das vilosidades intestinais podem ser geradas devido a agressão persistente de agentes químicos, físicos ou biológicos. No entanto, a visualização de estruturas sugestivas de microsporídeos e mixosporídeos sugere que as lesões foram causadas por fungos e parasitas.', 1703),
(624, 'Estômago', 'A necrose de coagulação da camada glandular podem ser ocasionadas pela persistência de agentes químicos, físicos ou biológicos. A inflamação por linfócitos sugere infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção.', 1703),
(625, 'Intestino', 'A hiperplasia de enterócitos (aumento do número das células), lise das vilosidades intestinais e atrofia das vilosidades intestinais (redução do tamanho da vilosidade) indicam lesão constante de origem biológica, química ou física. A hemorragia moderada indica lise vascular que pode ser por um trauma, intoxicação química ou infecção biológica.', 1661),
(626, 'Estômago', 'A inflamação discreta a moderada constituída de linfócitos e eosinófilos indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção.', 1661),
(627, 'Fígado', 'A degeneração macrogoticular de hepatócitos indica excesso de gordura na dieta ou intoxicação química.', 1661),
(628, 'Brânquias', 'A hiperplasia de células epiteliais (aumento do número de células epiteliais), fusionamento das lamelas secundárias e metaplasia (mudança do tipo de epitélio branquial) indicam agressão biológica, química ou física persistente. A telangiectasia é a dilatação dos vasos contendo sangue  e aneurismas podem ser causados por agentes químicos, físicos ou biológicos. A presença de eosinófilos indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção.', 1661),
(629, 'Brânquias', 'A hiperplasia de células epiteliais e de Goblet e metaplasia são o aumento de número dessas células e mudança do tipo do epitélio branquial que pode ser devido a agressão persistente por agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos sugere que as lesões foram causadas por bactérias.', 1700),
(630, 'Intestino', 'A lise das vilosidades intestinais pode ser causada por trauma, infecção biológica ou intoxicação química. A hiperplasia de enterócitos é o aumento do número dessas células e pode ser devido a agressão biológica, química ou física. A visualização de eosinófilos sugere infecção biológica ou quadro alérgico. No entanto, a visualização de estruturas sugestivas de coccídeos sugere que as lesões foram causadas por parasitos.', 1700),
(631, 'Fígado', 'A congestão é o acúmulo de sangue nos vasos sanguíneos que pode ser devido a intoxicação química, trauma ou infecção biológica. A degeneração macro e microgoticular pode ser devido ao excesso de gordura na dieta ou intoxicação química.', 1700),
(632, 'Estômago', 'A inflamação por linfócitos, eosinófilos e melanomacrófagos indicam infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção.', 1700),
(633, 'Brânquias', 'A hiperplasia de células epiteliais e metaplasia são o aumento de células epiteliais e mudança do eoitélio branquial que pode ser devido a agressão contínua de origem biológica, física ou química. No entanto, a visualização de eosinófilos sugere infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção.', 1701),
(634, 'Fígado', 'A degeneração macrogoticular de hepatócitos indica excesso de gordura na dieta ou intoxicação química. A congestão é a estase de sangue nos vasos sanguíneos que pode ser devido a uma intoxicação química, infecção biológica ou trauma. ', 1701),
(635, 'Estômago', 'Não foram observadas alterações histopatológicas dignas de nota.', 1701),
(636, 'Olho', 'Não foram observadas alterações histopatológicas dignas de nota.', 1701),
(637, 'Ovários', 'Não foram observadas alterações histopatológicas dignas de nota.', 1701),
(638, 'Intestino', 'A necrose de coagulação das vilosidades intestinais é a morte dos enterócitos que pode ser devido a agressão química, física ou biológica.', 1701),
(639, 'Musculatura esquelética', 'A hiperplasia de miócitos é o aumento do número dessas células que pode ser devido a agressão persistente por agentes biológicos, químicos ou físicos. No entanto, a visualização de cocos bacterianos sugere que a infecção biológica causou a hiperplasia.', 1701),
(640, 'Rim', 'A hemorragia discreta pode ser por trauma, infecção biológica ou intoxicação química. No entanto, a visualização de inúmeros cocos bacterianos sugere que o extravasamento de sangue dos vasos sanguíneos foi causado por uma infecção bacteriana.', 1701),
(641, 'Cérebro', 'A inflamação por linfócitos indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção. Além disso, foram notados inúmeros cocos bacterianos, sugerindo que a inflamação foi causada por bacteriose.', 1701),
(642, 'Coração', 'Não foram observadas alterações histopatológicas dignas de nota.', 1701),
(643, 'Bexiga natatória', 'Não foram observadas alterações histopatológicas dignas de nota.', 1701),
(644, 'Coração', 'A inflamação por linfócitos indica uma infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção.', 0),
(645, 'Intestino', 'A necrose de coagulação dos enterócitos pode ser devido a agressão contínua por agentes químicos, físicos ou biológicos. A lise das vilosidades intestinais pode ser devido a um trauma, intoxicação química ou infecção biológica.', 0),
(646, 'Estômago', 'A inflamação por linfócitos e eosinófilos indica uma infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção. A lise do epitélio gástrico pode ser devido a um trauma, infecção biológica ou intoxicação química.', 0),
(647, 'Fígado', 'A degeneração macrogoticular de hepatócitos sugere excesso de gordura na dieta ou intoxicação química. A congestão é o acúmulo de sangue nos vasos sanguíneos que pode ser devido a intoxicação química, trauma ou infecção biológica. No entanto, a observação de estruturas compatíveis com esporos de fungos sugere que as lesões possam ter sido causadas por fungos.', 0),
(648, 'Brânquias', 'A hiperplasia de células epiteliais e metaplasia são o aumento de número dessas células e mudança no epitélio branquial que pode ser devido a agressão contínua por agentes químicos, físicos ou biológicos. A lise do epitélio branquial pode ser devido a um trauma, intoxicação química ou infecção biológica. Os inúmeros aneurismas  (dilatação anormal dos vasos sanguíneos) observados podem ser causados por agentes químicos, físicos ou biológicos.', 0),
(649, 'Intestino', 'A lise das vilosidades intestinais pode ser causada por trauma, infecção biológica ou intoxicação química. No entanto, a visualização de cocos bacterianos e estruturas sugestivas de microsporídeos sugere que as lesões foram causadas por fungos e bactérias.', 2),
(650, 'Estômago', 'Não foram observadas alterações histopatológicas dignas de nota.', 2),
(651, 'Fígado', 'A degeneração macrogoticular de hepatócitos indica excesso de gordura na dieta ou intoxicação química. A congestão é o acúmulo de sangue nos vasos sanguíneos que pode ser devido a agressores químicos, físicos ou biológicos. ', 2),
(652, 'Brânquias', 'A hiperplasia de células epiteliais e metaplasia são o aumento do número dessas células e mudança no epitélio branquial que pode ser devido a agressão contínua de agentes químicos, físicos ou biológicos. Os inúmeros aneurismas (dilatação dos vasos sanguíneos com sangue) podem ser devido a agressores químicos, físicos ou biológicos. No entanto, a observação de estrutura sugestiva de Megalocytivírus sugere que as lesões foram causadas por infecção viral.', 2),
(653, 'Coração', 'A inflamação por linfócitos indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção.', 2),
(654, 'Estômago', 'A inflamação por linfócitos e eosinófilos indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção.', 1724),
(655, 'Brânquias', 'A hiperplasia de células epiteliais (aumento do número de células) pode ser devido a agressão contínua por agentes biológicos, químicos ou físicos. A congestão (acúmulo de sangue no vaso sanguíneo) pode ser em decorrência de um trauma, intoxicação química ou infecção biológica.', 1724),
(656, 'Baço', 'A hiperplasia de polpa branca (proliferação de linfócitos) e centros-melanomacrófagos indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção.', 1724),
(657, 'Intestino', 'A presença de eosinófilos indica infecção biológica ou quadro alérgico. No entanto, a visualização de estruturas sugestivas de microsporídeos, cocos bacterianos e estruturas sugestivas de esporos de fungos sugerem que a presença de eosinófilos indica infecção bacteriana e fúngica.', 1724),
(658, 'Fígado', 'Não foram observadas alterações histopatológicas dignas de nota.', 1724),
(659, 'Estômago', 'A inflamação por linfócitos e eosinófilos indicam infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção.', 1725),
(660, 'Intestino', 'A necrose (morte das células intestinais) e lise das vilosidades intestinais e hiperplasia de enterócitos (aumento do número de células) pode ser em decorrência da persistência de um agressor químico, físico ou biológico. No entanto, a visualização de estruturas sugestivas de microsporídeos indica que a infecção fúngica causou as alterações observadas.', 1725),
(661, 'Fígado', 'A congestão (acúmulo de sangue nos vasos sanguíneos) pode ser devido a um trauma, intoxicação química ou infecção biológica. No entanto, a visualização de estruturas sugestivas de esporos de fungos e colônias bacterianas sugere que o acúmulo de sangue tenha sido provocado por fungos e bactérias.', 1725),
(662, 'Brânquias', 'A hiperplasia de células epiteliais indica agressão contínua no epitélio por agentes químicos, físicos ou biológicos. No entanto, a visualização de Trichodina e Monogenea indica que o aumento de células foi ocasionado por parasitas.', 1725),
(663, 'Intestino', 'A necrose de coagulação dos enterócitos (morte celular) pode ser causada pela agressão contínua por agentes químicos, físicos ou biológicos. No entanto a visualização de colônias bacterianas e estruturas sugestivas de microsporídeos sugere que as lesões foram causadas por bactérias e fungos.', 1726),
(664, 'Baço', 'A hiperplasia de polpa branca (aumento da quantidade de linfócitos) e de centros-melanomacrófagos indicam infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção.', 1726),
(665, 'Fígado', 'A congestão (acúmulo de sangue nos vasos sanguíneos) pode ser devido a um trauma, intoxicação química ou infecção biológica. A necrose (morte celular) de coagulação dos hepatócitos pode ser devido a agressão contínua por agentes químicos, físicos ou biológicos. No entanto, a visualização de estruturas sugestivas de esporos de fungos e cocos bacterianos sugere que as lesões foram causadas por bactérias e fungos.', 1726),
(666, 'Brânquias', 'A hiperplasia de células epiteliais (aumento do número de células) e metaplasia (mudança do tipo do epitélio branquial) pode ser devido a agressão contínua por agentes químicos, físicos ou biológicos. No entanto, a visualização de Monogenea e Trichodina sugere que as lesões foram causadas por parasitas.', 1726),
(667, 'Estômago', 'Não foram observadas alterações histopatológicas dignas de nota.', 1726),
(672, 'Intestino', 'A necrose de coagulação do enterócitos (morte celular) e lise das vilosidades intestinais podem ser causadas pela agressão contínua por agentes químicos, físicos ou biológicos. No entanto, a visualização de colônias bacterianas sugere que as lesões foram causadas por bactérias.', 1727),
(673, 'Rim', 'A hemorragia pode ser causado por um trauma, infecção biológica ou intoxicação química. A degeneração hialina tubular é o acúmulo de proteína no seu interior, podendo ser causadas por agentes químicos, físicos ou biológicos. A calcificação distrofia é a deposição de cálcio sobre os túbulos renais devido a uma infecção biológica ou excesso desse mineral da dieta alimentar ou hídrica.', 1727),
(674, 'Fígado', 'A congestão é o acúmulo de sangue nos vasos sanguíneos que pode ser devido a agressão química, biológica ou física. O pigmento de melanina é um indicativo de excesso de ferro no metabolismo, podendo vir da dieta ou metabolização alterada por algum patógeno ou toxina. A inflamação por linfócitos e macrófagos sugere infecção, uma vez que essas células são recrutadas pelo organismo para combater esse tipo de infecção.', 1727),
(675, 'Brânquias', 'A hiperplasia de células epiteliais (aumento da quantidade dessas células) e metaplasia (mudança do epitélio branquial) podem ser desencadeadas pela agressão contínua por agentes químicos, físicos ou biológicos. No entanto, a visualização de Trichodina sugere que as lesões foram causadas por protozoários.', 1727),
(676, 'Brânquias', 'A metaplasia (mudança no tipo do epitélio) e hiperplasia de células epiteliais (aumento do número dessas células) podem ser causadas pela agressão contínua por agentes químicos, físicos ou biológicos. A presença de eosinófilos indica quadro alérgico ou infecção biológica. No entanto, a visualização de estruturas circulares basofílicas aderidas ao filamento branquial e livres indicam que as lesões foram causadas por parasitas.', 1839),
(677, 'Fígado', 'A degeneração macrogoticular de hepatócitos indicam excesso de gordura na dieta ou intoxicação química.', 1839),
(678, 'Intestino', 'A lise das vilosidades intestinais pode ser devido a um trauma, infecção biológica ou intoxicação química. A hiperplasia de enterócitos (aumento dessa quantidade dessas células) e atrofia das vilosidades intestinais (redução do tamanho da vilosidade) pode ser devido a agressão contínua por agentes químicos, físicos ou biológicos.', 1839),
(679, 'Estômago', 'A presença de eosinófilos pode indicar quadros alérgicos ou infeção biológica.', 1839),
(680, 'Fígado', 'A degeneração macrogoticular de hepatócitos pode ser devido a excesso de gordura na dieta ou intoxicação química.', 1840),
(681, 'Brânquias', 'A lise do epitélio branquial pode ser devido a um trauma, intoxicação química ou infecção biológica. A hiperplasia de células epiteliais (aumento da quantidade dessas células) e a metaplasia (mudança no tipo do epitélio) pode ser devido a agressão persistente de agentes químicos, físicos ou biológicos. A hemorragia e aneurismas (dilatação dos vasos sanguíneos com acúmulo de sangue) pode ser devido a presença e irritação do epitélio por agentes químicos, físicos ou biológicos. No entanto, a visualização de estruturas sugestivas de protozoários indicam que as lesões foram causadas por parasitas.', 1840),
(682, 'Baço', 'A hiperplasia de polpa branca (aumento da quantidade de linfócitos) indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção.', 1840),
(683, 'Estômago', 'A lise do epitélio gástrico pode ser devido a um trauma, intoxicação química ou infecção biológica.', 1840),
(684, 'Intestino', 'A lise das vilosidades intestinais pode ser devido a um trauma, intoxicação química ou infecção biológica. A hiperplasia de enterócitos (aumento da quantidade dessas células) e necrose de coagulação dos enterócitos (morte celular) pode ser devido a agressão contínua por agentes químicos, físicos ou biológicos.', 1840),
(685, 'Fígado', 'A congestão pode ser devido a um trauma, intoxicação química ou infecção biológica.', 1836),
(686, 'Brânquias', 'A hiperplasia de células epiteliais (aumento do número de células epiteliais) e metaplasia (mudança do tipo de célula do epitélio branquial) pode ser causadas pela agressão contínua por agentes químicos, físicos ou biológicos. No entanto, a visualização de estruturas sugestivas de mixozoários, Trichodina, Monogenea e cocos bacterianos indica que as lesões foram causadas por bactérias e parasitos.', 1836),
(687, 'Intestino', 'A presença de eosinófilos indica alergia ou infecção biológica. A lise e necrose de coagulação (morte das células intestinais) das vilosidades intestinais podem ser causadas pela agressão contínua de agentes físicos, químicos ou biológicos. No entanto, a presença de estruturas sugestivas de coccídeos e cocos bacterianos sugere que as lesões foram causadas por bactérias e parasitos.', 1836),
(688, 'Fígado', 'Embora não tenha sido observada lesão, foram notadas estruturas sugestivas de mixosporídeos.', 1837),
(689, 'Intestino', 'A lise das vilosidades intestinais, necrose de coagulação das vilosidades intestinais (morte das células intestinais) e hiperplasia de enterócitos (aumento do número de enterócitos) podem ser causados pela agressão contínua de agentes químicos, físicos ou biológicos. No entanto, a visualização de cocos bacterianos sugere que as lesões foram causadas por bactérias.', 1837),
(690, 'Brânquias', 'A hiperplasia de células epiteliais (aumento da quantidade de células epiteliais) e metaplasia (mudança no tipo do epitélio branquial) podem ser causados pela agressão contínua de agentes químicos, físicos ou biológicos. No entanto, a visualização de Trichodina sugere que as lesões foram causadas por parasitas.', 1837),
(691, 'Rim', 'A hemorragia pode ser causada por um trauma, intoxicação química ou infecção biológica. A inflamação por linfócitos indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção. A hiperplasia de células epiteliais dos glomérulos renais (aumento de células epiteliais nos glomérulos) e degeneração hidrópica dos túbulos renais podem ser causadas pela agressão contínua de agentes químicos, físicos ou biológicos.  No entanto, a visualização de cocos bacterianos sugere que as lesões foram causadas por bactérias.', 1837),
(692, 'Baço', 'A hemorragia pode ser causada por um trauma, intoxicação química ou infecção biológica. A hiperplasia de centros-melanomacrófagos (aumento da quantidade de macrófagos) indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção. No entanto, foram notadas estruturas sugestivas de mixosporídeos sugerindo que as lesões foram causadas por parasitas.', 1837),
(693, 'Estômago', 'A lise do epitélio gástrico pode ser devido a um trauma, intoxicação química ou infecção biológica. No entanto, foram notadas estruturas sugestivas de mixosporídeos sugerindo que as lesões foram causadas por parasitas.', 1837),
(694, 'Baço', 'A hemorragia pode ser em decorrência de um trauma, infecção biológica ou intoxicação química. A hiperplasia de centros-melanomacrófagos (aumento da quantidade de melanomacrófagos) indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção.', 1838),
(695, 'Intestino', 'A lise das vilosidades intestinais, a hiperplasia de enterócitos (aumento da quantidade de enterócitos) e necrose de coagulação das vilosidades intestinais (morte de células intestinais) podem ser causadas pela agressão contínua por agentes químicos, físicos ou biológicos. A presença de eosinófilos indica infecção biológica ou quadro alérgico. No entanto, foram visualizadas estruturas sugestivas de microsporídeos que indicam que as lesões foram causadas por fungos.', 1838),
(696, 'Fígado', 'A congestão (acúmulo de sangue no vaso sanguíneo) pode ser causado por trauma, intoxicação química ou infecção biológica. Também foi observado pigmento de melanina.', 1838),
(697, 'Brânquias', 'A hiperplasia de células epiteliais (aumento da quantidade de células epiteliais) e metaplasia (mudança no tipo do epitélio branquial) podem ser causados pela agressão contínua de agentes químicos, físicos ou biológicos. No entanto, a visualização de estrutura sugestiva de protozoário indica que as lesões foram causadas por parasitas.', 1838),
(698, 'Fígado', 'A congestão moderada (acúmulo de sangue nos vasos sanguíneos) pode ser devido a um trauma, infecção biológica ou intoxicação química.', 1889),
(699, 'Estômago', 'A lise do epitélio branquial pode ser devido a um trauma, infecção biológica ou intoxicação química. A presença de eosinófilos sugere infecção biológica ou alergia.', 1889),
(700, 'Intestino', 'A lise nas vilosidades intestinais pode ser devido a um trauma, infecção biológica ou intoxicação química. No entanto, foram notadas estruturas sugestivas de coccídeos, sugerindo que a lise foi causada por parasitas.', 1889),
(701, 'Fígado', 'A congestão (acúmulo de sangue nos vasos sanguíneos) pode ser causado por trauma, infecção biológica ou intoxicação química.', 1890),
(702, 'Intestino', 'A lise das vilosidades intestinais pode ser devido a um trauma, infecção biológica ou intoxicação química. No entanto, a visualização de cocos bacterianos e estrutura sugestiva de mixosporídeo sugere que a lise foi causada por parasitas e bactérias.', 1890),
(703, 'Estômago', 'Não foram notadas alterações histopatológicas dignas de nota.', 1890),
(704, 'Brânquias', 'A lise do epitélio branquial pode ser devido a um trauma, infecção biológica ou intoxicação química. A hiperplasia de células epiteliais (aumento da quantidade de células epiteliais) e metaplasia (mudança no tipo do epitélio branquial) podem ser causados pela agressão contínua por agentes químicos, físicos ou biológicos. No entanto, a visualização de Trichodina sugere que as lesões foram causadas por parasitas.', 1890),
(705, 'Baço', 'A hemorragia pode ter sido causado em decorrência a um trauma, infecção biológica ou intoxicação química. A hiperplasia de melanomacrófagos indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção.', 1890),
(706, 'Músculo esquelético', 'A congestão acentuada (acúmulo de sangue no interior dos vasos sanguíneos) pode ter sido causado por um trauma, infecção biológica ou intoxicação química. O infiltrado inflamatório constituído de linfócitos indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção. A vacuolização moderada da camada muscular pode ser devido a agressão por agentes químicos, físicos ou biológicos. No entanto, a presença de inúmeros agregados de cocos bacterianos indica que as lesões foram causadas por bactérias. Além disso, na epiderme foram notados cistos repletos de fibroblastos (células de reparação de lesão na pele) e bactérias (cocos), demonstrando que as lesões foram provavelmente causadas por bactérias.', 1996),
(707, 'Coração', 'A hemorragia moderada pode ter sido causado por um trauma, infecção biológica ou intoxicação química.', 1997),
(708, 'Intestino', 'A inflamação por linfócitos e presença de eosinófilos indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção. Além disso, foi notado colônia bacteriana, reafirmando que há um processo infeccioso bacteriano.', 1997),
(709, 'Brânquias', 'A hiperplasia de células epiteliais (aumento do número de células epiteliais) e metaplasia (mudança no tipo do epitélio) podem ser causadas pela agressão contínua de agentes químicos, físicos ou biológicos. A hemorragia moderada e telangiectasia (dilatação dos vasos sanguíneos) podem terem sido causadas por um trauma, infecção biológica ou intoxicação química.', 1997),
(710, 'Fígado', 'A congestão (acúmulo de sangue nos vasos sanguíneos) pode ter sido causado por um trauma, infecção biológica ou intoxicação química. A degeneração macrogoticular de hepatócitos indica intoxicação química ou excesso de gordura na dieta.', 1997),
(711, 'Baço', 'A hemorragia moderada pode ter sido causado por um trauma, infecção biológica ou intoxicação química.', 1997),
(712, 'Rim', 'A hemorragia moderada  e congestão (acúmulo de sangue nos vasos sanguíneos) pode ter sido causado por um trauma, infecção biológica ou intoxicação química. A degeneração hialina tubular pode ser ocasionado pela agressão contínua por agentes químicos, físicos ou biológicos. A inflamação por linfócitos indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo de infecção. Essa hipótese é reafirmada pela visualização de inúmeras colônias bacterianas.', 1997),
(713, 'Intestino', 'A hiperplasia de enterócitos e células caliciformes (maior quantidade dessas células) e lise das vilosidades intestinais pode ser devido a agressão contínua por agentes químicos, físicos ou biológicos. A hemossiderina é um pigmento formado quando há lise de hemácias, oriundo de trauma, intoxicação química ou infecção biológica. A presença de eosinófilos indica quadro alérgico ou infecção biológica. A presença de muco é uma resposta do organismo para eliminar algum agente agressor. No entanto, a visualização de estruturas sugestivas de mixosporídeos e cocos bacterianos sugere que as lesões foram causadas por parasitas ou bactérias.', 2008),
(714, 'Fígado', 'A degeneração macrogoticular de hepatócitos indica acúmulo de gordura da dieta ou intoxicação química. ', 2008),
(715, 'Estômago', 'A presença de eosinófilos indica quadro alérgico ou infecção biológica. No entanto, a visualização de estruturas sugestivas de mixozoários sugere que os eosinófilos foram recrutados pelo sistema imune para combater essa infecção parasitária.', 2008),
(716, 'Brânquias', 'A hiperplasia de células epiteliais (aumento da quantidade de células epiteliais) e fusionamento dos filamentos branquiais (fusão do tecido branquial) pode ser devido a agressão contínua por agentes químicos, físicos ou biológicos.', 2008),
(717, 'Estômago', 'A inflamação por linfócitos e a presença de eosinófilos, indica infecção biológica, uma vez que essas células são recrutadas pelo sistema imune para combater esse tipo d e infecção. Essa hipótese é reafirmada pela presença de cocos bacterianos.', 1998),
(718, 'Brânquias', 'A hiperplasia de células epiteliais (aumento do número de células epiteliais) e metaplasia (mudança no tipo do epitélio branquial) é devido a agressão contínua por agentes químicos, físicos ou biológicos. O edema dos filamentos branquiais é devido a inflamação que pode ser causada por agentes químicos, físicos ou biológicos. No entanto, foram observadas colônias bacterianas, estruturas sugestivas de Ichthyobodo, Trichodina, monogenea e Piscinoodinium, sugerindo que as lesões foram causadas por bactérias e parasitas.', 1998),
(719, 'Baço', 'A hiperplasia de polpa branca (aumento da quantidade de linfócitos) e de centros-melanomacrófagos (aumento da quantidade de macrófagos) indicam infecção biológica, uma vez que essas células são recrutadas pelo organismo para combater esse tipo de infecção. A degeneração hialina de linfócitos indica lesão das organelas, início de morte celular.', 1998),
(720, 'Intestino', 'A hiperplasia de enterócitos (aumento da quantidade dessas células) é devido a agressão contínua por agentes químicos, físicos ou biológicos. A presença de hemossiderina indica lesão dos vasos sanguíneos que pode ser causado pela agressão de agentes biológicos, químicos ou físicos. A presença de eosinófilos indica infecção biológica ou quadro alérgico. No entanto, a visualização de estruturas sugestivas de mixosporídeos indicam que as lesões foram causadas por parasitas.', 1998);
