(45, '- Corrosão de nadadeira caudal ', 15, 'Refrigerado', 'lambari (Astyanax sp.)', 85, '2020-10-22', 'Coletado', '2020-10-22', 'Sem IdentificaÃ§Ã£o', 1, 'Após realização das análises microbiológicas, foi possível identificar duas espécies bacterianas distintas nos animais analisados. Bactérias do gênero Aeromonas estão intimamente relacionadas a patogenias em peixes, por se tratar de um microrganismo oportunista que se aproveita de um estado de debilidade dos peixes, estado esse que pode ser provocado por um agente estressor biológico (parasitas) ou ambiental (mudanças climáticas, temperatura, oxigênio, etc). Já bactérias do gênero Serratia, estão comumente relacionadas doenças em humanos, não havendo relatos significativos da sua presença em peixes\r\n', '2020-11-04', 'prancha aperam.png'),
