INSERT INTO `molecular_tipo` (`ID`, `Tipo`, `tipo_text`) VALUES
(1, 'Aeromonas hydrophila', '<p>\r\n  <strong>Metodologia de diagnóstico:</strong>\r\n  <br>\r\n  <span style\"text-align: justify\">					\r\n    - Extração de material genético com uso de kit de extração de DNA de tecido, seguindo as recomendações do fabricante;<br>\r\n    - PCR em tempo real com agente fluorescente SYBR Green modificado do protocolo descrito por Sebastião et al.(2018);<br>			                      \r\n    - Os primers reconhecem a sequência específica do DNA da bactéria (<i>Aeromonas hydrophila</i>);<br>							\r\n    - Referência: Sebastiao, F., Lemos, E. M., & Pilarski, F. (2018). Development of an absolute quantitative real-time PCR (qPCR) for the diagnosis of <i>Aeromonas hydrophila infections in fish</i>. Acta Scientific Microbiology, 1, 23-29.<br>							\r\n    - Em todas as reações utiliza-se como controle positivo uma amostra naturalmente infectada, a qual foi sequenciada pelo método de <i> Sanger</i> e confirmada com 100% de identidade. Como controle negativo é usada água livre de ácidos nucleicos;<br>						\r\n    -A padronização a partir de testes de especificidade e sensibilidade permite confirmar uma amostra como POSITIVA se esta apresentar Ct menor ou igual a 33 e curva de dissociação (Melt Curve) com o mesmo pico que o controle positivo (mesma Tm).\r\n  </span>\r\n</p>'),
(2, 'Streptococcus agalactiae', '<p>\r\n  <strong>Metodologia de diagnóstico:</strong>\r\n  <br>\r\n  <span style\"text-align: justify\">	\r\n    - Extração de material genético com uso de kit de extração de DNA de tecido, seguindo as recomendações do fabricante;<br>\r\n    - PCR em tempo real com agente fluorescente SYBR Green modificado do protocolo descrito por Sebastião (2015);<br>\r\n    - Os primers reconhecem a sequência específica do DNA da bactéria (<i>Streptococcus agalactiae</i>);<br>\r\n    - Referência: Sebastião, F. D. A. (2015). Validação de técnicas moleculares para o diagnóstico de bactérias empeixes, visando redução de tempo e custo.\r\n    - Em todas as reações utiliza-se como controle positivo uma amostra naturalmente infectada, a qual foi sequenciada pelo método de <i> Sanger</i> e confirmada com 100% de identidade. Como controle negativo é usada água livre de ácidos nucleicos;<br>\r\n    - A padronização a partir de testes de especificidade e sensibilidade permite confirmar uma amostra comoPOSITIVA se esta apresentar Ct menor ou igual a 33 e curva de dissociação (Melt Curve) com o mesmo pico que o controle positivo (mesma Tm).\r\n  </span>\r\n</p>'),
(4, 'Francisella noatunensis subspécie orientalis', '<p>\r\n  <strong>Metodologia de diagnóstico:</strong>\r\n  <br>\r\n  <span style\"text-align: justify\">	\r\n    - Extração de material genético com uso de kit de extração de DNA de tecido, seguindo as recomendações do fabricante.<br>\r\n    - PCR em tempo real com agente fluorescente SYBR Green modificado do protocolo descrito por Soto et al. (2010).<br>\r\n    - Os primers reconhecem a sequência específica do DNA da bactéria (<i> Francisella noatunensis subspécie orientalis </i>).<br>\r\n    - Referência: Soto, E., Bowles, K., Fernandez, D., & Hawke, J. P. (2010). Development of a real-time PCR assay for identification and quantification of the fish pathogen <i>Francisella noatunensis subsp. orientalis</i>. Diseases of aquatic organisms, 89(3), 199-207.<br>\r\n    - Em todas as reações utiliza-se como controle positivo uma amostra naturalmente infectada, a qual foi sequenciada pelo método de <i> Sanger</i>  e confirmada com 100% de identidade. Como controle negativo é usada água livre de ácidos nucleicos;<br>\r\n    - A padronização a partir de testes de especificidade e sensibilidade permite confirmar uma amostra como POSITIVA se esta apresentar Ct menor ou igual a 33 e curva de dissociação (Melt Curve) com o mesmo pico que o controle positivo (mesma Tm) <br>\r\n  </span>\r\n</p>'),
(5, 'Flavobacterium columnare', '<p>\r\n  <strong>Metodologia de diagnóstico:</strong>\r\n  <br>\r\n  <span style\"text-align: justify\">	\r\n    - Extração de material genético com uso de kit de extração de DNA de tecido, seguindo as recomendações do fabricante;<br>\r\n    - PCR em tempo real com agente fluorescente SYBR Green modificado do protocolo descrito por Gibbs et al. (2020);<br>\r\n    - Os primers reconhecem a sequência específica do DNA da bactéria (<i>Flavobacterium columnare</i>);<br>\r\n    - Referência: Gibbs, G. D., Griffin, M. J., Mauel, M. J., & Lawrence, M. L. (2020). Validation of a quantitative PCR assay for the detection of 2 <i>Flavobacterium columnare genomovars</i>. Journal of Veterinary Diagnostic Investigation, 32(3), 356-362. <br>\r\n    - Em todas as reações utiliza-se como controle positivo uma amostra naturalmente infectada, a qual foi sequenciada pelo método de <i> Sanger</i> e confirmada com 100% de identidade. Como controle negativo é usada água livre de ácidos nucleicos;<br>\r\n    - A padronização a partir de testes de especificidade e sensibilidade permite confirmar uma amostra como POSITIVA se esta apresentar Ct menor ou igual a 33 e curva de dissociação (Melt Curve) com o mesmo pico que o controle positivo (mesma Tm). <br>\r\n  </span>\r\n</p>');
